INSERT INTO `joke` (`id`, `title`, `content`, `rating`, `votes`, `likes`, `url`, `comments_count`) VALUES
(1, 'Clean Restaurant Joke', 'So these two roaches, Tom and Oscar, are hanging out next to a dumpster enjoying a snack. “Hey Tom” said Oscar  to his friend, “You know that restaurant down the block? I went there yesterday to pick up some scraps, and I couldn’t believe how clean it was, I could practically see my reflection through the shiny waxed floor.” “Oscar” hollered Tom spitting the food out of his mouth, “please not while I am eating!!”\n', 2.3, 525, 0, 'http://www.greatcleanjokes.com/2779/roach-joke/', 17),
(2, 'Lawyers Daughter Joke', 'Q. What did the lawyer name his daughter?\nA. Sue.\n', 3.4, 391, 0, 'http://www.greatcleanjokes.com/2083/lawyers-daughter-joke/', 4),
(3, 'Hilarious Video –  About Phobias', '\n', 4.3, 114, 0, 'http://www.greatcleanjokes.com/1269/hillarious-video-about-phobias/', 10),
(4, 'Surgery Joke', 'Before going in for surgery I thought it would be funny if I posted a note on myself telling the surgeon to be careful. After the surgery I found another note on myself .”Anyone know where my cell phone is????????”\n', 2.8, 236, 0, 'http://www.greatcleanjokes.com/632/632/', 5),
(5, 'Heaven Joke', 'A man died and went to The Judgment, they told him , “Before you meet with God,  I should tell you — we’ve looked over your life, and to be honest you really didn’t do anything particularly good or bad. We’re not really sure what to do with you. Can you tell us anything you did that can help us make a decision?”\nThe newly arrived soul thought for a moment and replied, “Yeah, once I was driving along and came upon a person who was being harassed by a group of thugs. So I pulled over, got out a bat, and went up to the leader of the thugs. He was a big, muscular guy with a ring pierced through his lip. Well, I tore the  ring out of his lip, and told him he and his gang had better stop bothering this guy or they would have to deal with me!”\n“Wow that’s impressive, “When did this happen?”\n“About three minutes ago,” came the reply.\n', 4.2, 674, 0, 'http://www.greatcleanjokes.com/497/497/', 12),
(6, 'Memory Problems Joke', 'A few old couples used to get together to talk about life and to have a good time. One day one of the men, Harry, started talking about this fantastic restaurant he went to the other night with his wife. “Really?”, one of the men said, what’s it called? After thinking for a few seconds the Harry said, “what are those good smelling flowers called again?” “Do you mean a rose? the first man questioned. “Yes that’s it,” he exclaimed. Looking over at his wife he said, “Rose what’s that restaurant we went to the other night?”\n', 4.1, 191, 0, 'http://www.greatcleanjokes.com/427/memory-problems/', 3),
(7, 'Can You Hear Me??????', 'An old man went to the Doctor complaining that his wife could barely hear. The Doctor suggested a test to find out the extent of the problem. “Stand far behind her and ask her a question, and then slowly move up and see how far away you are when she first responds.” The old man excited to finally be working on a solution for the problem, runs home and sees his wife preparing supper. ” Honey” the man asks standing around 20 feet away “whats for supper?” After receiving no response he tried it again 15 feet away, and again no response. Then again at 10 feet away and again no response. Finally he was 5 feet away “honey whats for supper?”\nShe replies “For the fourth time it’s lasagna!”  \n\n', 4.2, 441, 0, 'http://www.greatcleanjokes.com/282/funny-speach-opener-2/', 10),
(8, 'The Forgetful Actor', 'An actor had been out of work for 15 years because he always forgot his lines. Then one day he got a phone call from a director who wanted him for a big part in a play. All he had to say was “Hark! I hear the cannon roar! After much worry the actor decided to take  the role. Opening night arrived, and while he waited in the wings, the actor muttered to himself “Hark! I hear the cannon roar! Hark! I hear the cannon roar! The time for the entrance finally came and as the actor made his appearance, he heard a loud brooooom! He turned around and said, “what the hell was that?” -Robert De Nero\n', 3.3, 165, 0, 'http://www.greatcleanjokes.com/143/funny-speach-opener/', 4),
(9, 'Woops Sorry About That', 'Marvin, was in the hospital on his death bed. The family called Marvin’s Preacher to be with him in his final moments. As the Preacher stood by the bed, Marvin’s condition seemed to deteriorate, and Marvin motioned for someone to quickly pass him a pen and paper. The Preacher quickly got a pen and paper and lovingly handed it to Marvin. But before he had a chance to read the note, Marvin died. The Preacher feeling that now wasn’t the right time to read it put the note in his jacket pocket. It was at the funeral while speaking that the Preacher suddenly remembered the note. Reaching deep into his pocket the Preacher said “and you know what, I suddenly remembered that right before Marvin died he handed me a note, and knowing Marvin I’m sure it was something inspiring that we can all gain from. With that introduction the Preacher ripped out the note and opened it.\nThe note said “HEY, YOU ARE STANDING ON MY OXYGEN TUBE!”\n', 4.3, 712, 0, 'http://www.greatcleanjokes.com/139/funny-speach-openers/', 19),
(10, 'The “Bottom”', 'Q.What has a bottom at its top?\n', 3.8, 153, 0, 'http://www.greatcleanjokes.com/86/short-joke-4/', 2),
(11, 'Dying Fears Joke', 'Adam woke up suddenly, sweating all over.  ”What’s the problem”, asked his wife.  ”Are you OK?”   “I just dreamed that I died!”  responded a shaken Adam.  ”And it was so bad up there, and that’s why you’re sweating all over?”  asked his wife.  ”You bet!”  exclaimed Adam.  ”I got up there, and was right in front of G-d himself, when he suddenly sneezed…..and I didn’t know what to say to him!  Whoa was that traumatic!”\n', 2.6, 79, 0, 'http://www.greatcleanjokes.com/3742/dying-fears-joke/', 0),
(12, 'Money Talks Joke', 'Eddy was just a regular guy. Except for the fact that he was an only child and the fact that his billionaire father was breathing his last. \nSince Eddy was a soon to be billionaire  it only made sense that he should have a woman to share his riches with. Eddy approached his childhood crush. “Hey Sandra, I may look like a regular guy, but I’m soon gonna be a billionaire! Do you wanna come home with me?”\n“Sure thing” Sandra replied, “I would love to come home with you.” \nAnd that’s the story how Sandra became Eddie’s Stepmother.\n', 2.7, 52, 0, 'http://www.greatcleanjokes.com/3394/money-talks-joke/', 2),
(13, 'Last Wishes Joke', 'Old Max had started out as a diamond cutter, and through hard work and good judgement he finally became the owner of a National chain of jewelry stores.  He was wealthy indeed.  \nBut now, he lay dying, so he called his wife to his side. “Hannah,” he began, “I always meant to draw up a will but somehow I never got around to it.  So pay close to attention to my last wishes.”\n“Yes, Max, I am listening,” Hannah wept.  “Whatever you want, it will be done.”  \n“First of all, the business I leave to Harry.”\n“Oh, no, Max, not to Harry!”  his wife protested.  “With Harry it’s girl-girls-girls!  Leave the business better to Jerome.  He’s at least reliable and has a good head for figures.”\n“Alright, let it be Jerome,” sighed the dying man.  “To Harry I leave the stocks and bonds.”\n“Better you should leave me the stocks and bonds.  I should take care he doesn’t squander it on women or cards.”\n“Very well, in your name I leave the securities.  And the summer house I leave to our sweet Minnie.”\n“Minnie!”  exclaimed his wife.  “What for what does Minnie need another summer house?  Her husband didn’t buy her one last year?  Give it to Anna – her husband is a poor man.  After all she’s our flesh and blood too.”\n“Fine!  Anna gets the summer house,” he sighed resignedly.  “And to our youngest Abe, I leave the car and the warehouses.”\n“But Abe has already 2 cars.  What does he need with another one?  And he wants to be a musician – what would he do with warehouses?  Take my advice and give them to Louis.”\nThat did it! Old Max had taken all he could of his wife’s interference.  Raising himself off the pillow and summoning his last ounce of strength, he snapped, “Hannah, you are a good women and have been a fine wife and mother.  But listen – who the hell is dying around here – you or me?”\n', 2.8, 47, 0, 'http://www.greatcleanjokes.com/3212/last-wishes-joke/', 0),
(14, 'Hearse Joke', 'Jim grabbed his suitcase off the luggage carousel and headed outside to hail a taxi. A taxi promptly picked him up and they were on there way. Twenty minutes into the ride Jim had a question for the taxi driver, “Excuse me sir” said Jim tapping the driver on the shoulder. “AHHHH\nHHH” screamed the taxi driver swerving the taxi across three lanes of traffic finally stopping the car on the opposite shoulder. “What the heck was that all about?” demanded Jim thoroughly shaken. “I’m sorry,” said the taxi driver, wiping his brow, “this is my first day on the job, I’ve been driving a hearse for the last fifty years!”\n', 4, 78, 0, 'http://www.greatcleanjokes.com/3160/hearse-joke/', 0),
(15, 'Last Wish Joke', 'Anne was on her deathbed breathing her last. “Anne”, said Anne’s husband Jim. “Please, please,tell me, is there anything I can do for you?” “Well” croaked Anne, “There is something. After I die, it would mean so much to me if you would marry my best friend Sandra.”  “You have nothing to worry about Anne” said Jim taking her hand, “I’ve been thinking about that for a while now already.”\n', 3.3, 47, 0, 'http://www.greatcleanjokes.com/3140/last-wish-joke/', 0),
(16, 'Deathbed Joke', 'Edward was lying on his deathbed and the family was taking turns spending time with him.    As he was speaking to his young granddaughter Emily, Edward suddenly smelled an all too familiar smell.  Why it was his favorite – apple pie!  His wife Sandy must have been baking it for him to enjoy this one last time.  “Emily dear,” asked Edward.  “Would you please go ask Grandma for a slice of that Apple Pie?  It’s smells so delicious!”  Emily ran off to fulfill her dying Grandfather’s last wish.  A moment later, Emily returned empty handed.  “Where’s my pie?”  questioned Edward.  “Grandma said it’s not for now” responded Emily, “it’s for the funeral”.\n', 3.6, 49, 0, 'http://www.greatcleanjokes.com/3101/deathbed-joke/', 0),
(17, 'The Execution Joke', 'Three men, a Frenchman, an Italian, and a Jew, were condemned to be executed. Their captors told them that they had the right to have a final meal before the execution. They asked the Frenchman what he wanted.\n“Give me some good French wine and French bread,” he requested. So they gave it to him, he ate it, and then they executed him.\nNext it was the Italian’s turn. Give me a big plate of pasta,” said the Italian. So they brought it to him, he ate it, and then they executed him.\nNow it was the Jew’s turn. “I want a big bowl of strawberries, ” said the Jew.\n“Strawberries!!! They aren’t even in season!”\n“So, I’ll wait…”\n', 4.2, 282, 0, 'http://www.greatcleanjokes.com/137/jewish-humor/', 7),
(18, 'Flowers Joke', '“What the heck is going on here?” said an angry  man storming into the florist shop. “I just lost one of my main clients and it’s your fault!”\n“Why don’t you calm down a bit” said the lady behind the counter, “and let us know what exactly happened.”\n“Well,” said the man “My biggest client moved to a new location, and to be nice I called you guys up and asked you to send him some flowers with a note saying “congratulations on your new location.”\nHe calls me up and says to me “what’s the big deal with sending me  a note that says “rest in peace?!”\n“Oh no!” she sighed, “now I know why I got a nasty message from the funeral parlor!”\n \n \n', 3.5, 54, 0, 'http://www.greatcleanjokes.com/3520/flowers-joke/', 0),
(19, 'Enough Is Enough', 'My old aunts  used to come up to me at weddings, poking me in the ribs and cackling,  “You’re next!”\nAfter a while, I figured out how to stop them. I started doing the same thing to them at funerals!\n', 4.1, 293, 0, 'http://www.greatcleanjokes.com/1570/enough-is-enough/', 2),
(20, '5 Best  Pick-up Line Comebacks', 'Man – Haven’t I seen you someplace before?\nWoman – Yes, that’s why I don’t go there anymore.\nMan – Can I buy you a drink?\nWoman – I think I’d rather have the money!\nMan – Will you go out with me this Saturday?\nWoman –  Sorry, I’m having a headache this weekend.\nMan –  Is this seat empty?\nWoman –  Yes, and this one will be if you sit down.\nMan –  So what do you do for a living?\nWoman –  I’m a female impersonator.\n', 3.8, 165, 0, 'http://www.greatcleanjokes.com/3522/5-best-pick-up-line-comebacks/', 0),
(21, 'Wanna Date Comeback', 'Man – “So do you want to go out maybe?”\nWomen – “Sorry, I don’t date outside my species.” \n', 3, 195, 0, 'http://www.greatcleanjokes.com/2061/wanna-date-comeback/', 1),
(22, 'Homework Joke', 'PUPIL – “Would you punish me for something I didn’t do?”\nTEACHER – “Of course not.”\nPUPIL – “Good, because I haven`t done my homework.”\n', 4.2, 653, 0, 'http://www.greatcleanjokes.com/2055/homework-joke/', 12),
(23, 'Getting Overpaid Joke', 'An employee approached his boss regarding a dispute on his pay-check…\nEmployee – Sir, this is $100 less than my salary.\nBoss – I know. But last month, when you were overpaid $100, by mistake, you didn’t complain!\nEmployee – Well, I don’t mind an occasional mistake, sir, but it seems to be becoming a habit, now! \n', 3.5, 228, 0, 'http://www.greatcleanjokes.com/2053/getting-overpaid-joke/', 3),
(24, 'Relative Joke', 'Wife – You hate my relatives!\nHusband – No, I don’t! In fact, I like your mother-in-law more than I like mine. \n', 3.9, 166, 0, 'http://www.greatcleanjokes.com/2048/relative-joke/', 2),
(25, 'You Smell Comeback', 'Person#1: Why do you smell funny?\nPerson#2: It’s called Soap – didn’t think you would have smelt it before.\n', 4, 131, 0, 'http://www.greatcleanjokes.com/1857/you-smell-comeback/', 1),
(26, 'Dance Refusal Comeback', 'Man- Do you want to dance?\nWoman- NO\nMan- Sorry, I think you misheard me…I said, You Look fat in those pants.\n', 3.9, 193, 0, 'http://www.greatcleanjokes.com/1855/dance-refusal-comeback/', 0),
(27, 'Boy Girl Joke', 'Boy – Would you like to dance?\nGirl – Yes!\nBoy – So I can take this chair?\n', 3.5, 81, 0, 'http://www.greatcleanjokes.com/3745/boy-girl-joke/', 0),
(28, 'Employee Insults', '“Since my last report, this employee has reached rock bottom and has started to dig.”\n“I would not allow this employee to breed.”\n“Works well when under constant supervision and cornered like a rat in a trap.”\n“He would be out of his depth in a parking lot puddle.”\n“This employee is depriving a village somewhere of an idiot.”\n“This employee should go far, and the sooner he starts, the better.”\n“I would like to go hunting with him sometime.”\n“He brings a lot of joy whenever he leaves the room.”\n“When his I.Q. reaches 50, he should sell.”\n“If you see two people talking and one looks bored, he’s the other one.”\n“Donated his brain to science before he was done using it.”\n“If he were any more stupid, he’d have to be watered twice a week.”\n“If you gave him a penny for his thoughts, you’d get change.”\n“If you stand close enough to him, you can hear the ocean.”\n“Takes him two hours to watch 60 Minutes.”\n“The wheel is turning, but the hamster is dead.”\n', 3.7, 33, 0, 'http://www.greatcleanjokes.com/3384/employee-insults/', 0),
(29, 'Bad Example Joke', 'You are not totally useless, you can be used as an bad example!\n', 3.5, 175, 0, 'http://www.greatcleanjokes.com/2417/bad-example-joke/', 4),
(30, 'Nature Joke', 'It’s amazing you love nature so much in spite of what it did to you.\n', 3.5, 94, 0, 'http://www.greatcleanjokes.com/2312/nature-joke/', 2),
(31, 'Dark And Handsome Joke', 'You are dark and handsome; when it’s dark, you are handsome.\n', 3.6, 103, 0, 'http://www.greatcleanjokes.com/2189/dark-and-handsome-joke/', 2),
(32, 'Crayon Joke', 'I’d explain it to you, but I don’t have any crayons with me.\n', 3.1, 95, 0, 'http://www.greatcleanjokes.com/2116/crayon-joke/', 0),
(33, 'Psychology Joke', 'I would probably find you more interesting had I studied psychology. \n', 2.7, 40, 0, 'http://www.greatcleanjokes.com/2114/psychology-joke/', 2),
(34, 'Happiness Joke', 'Some people bring happiness wherever they go – you bring happiness whenever you go.\n', 3.6, 69, 0, 'http://www.greatcleanjokes.com/2110/happiness-joke/', 0),
(35, 'Battle Of Wits Joke', 'I’m sorry, I refuse to have A battle of wits with an unarmed person.\n', 3.8, 43, 0, 'http://www.greatcleanjokes.com/2069/battle-of-wits-joke/', 1),
(36, 'Good Looks Insult', 'Someday you may lose your hair, you may lose your teeth, your money and even lose your mind. But one thing you will never lose – your good looks, coz you can never lose what you don’t have! \n', 4.2, 145, 0, 'http://www.greatcleanjokes.com/1960/good-looks-insult/', 0),
(37, 'Slow Person Insult', 'The closest she/he’ll ever get to a brainstorm is a slight drizzle.\n', 3.5, 39, 0, 'http://www.greatcleanjokes.com/1861/slow-person-insult/', 0),
(38, 'Stupid Person Insult', 'It’s hard to get the big picture when you have such a small screen. \n', 3.1, 36, 0, 'http://www.greatcleanjokes.com/1859/stupid-person-insult/', 0),
(39, 'I’m Busy Insult', 'I’m busy now. Can I ignore you some other time?\n', 4.2, 28, 0, 'http://www.greatcleanjokes.com/1853/im-busy-insult/', 0),
(40, 'Being Yourself Insult', 'Anybody who told you to be yourself, simply couldn’t have given you worse advice.\n', 3.6, 28, 0, 'http://www.greatcleanjokes.com/1851/being-yourself-insult/', 0),
(41, 'Hairy Insult', 'Next time you shave, try standing an inch or two closer to the blade.\n', 3.6, 28, 0, 'http://www.greatcleanjokes.com/1849/hairy-insult/', 1),
(42, 'Banana Joke', 'Yo Mamma has such a big mouth; she could eat a banana sideways.\n', 3.2, 191, 0, 'http://www.greatcleanjokes.com/2112/banana-joke-2/', 1),
(43, 'The Menu Joke', 'Yo mama is so fat she goes to a restaurant, looks at the menu and says “okay!”\n', 2.9, 165, 0, 'http://www.greatcleanjokes.com/183/yo-mama-joke-3/', 6),
(44, 'Chubby Mama', 'yo mama is so fat people jog around her for exercise.\n', 3.6, 115, 0, 'http://www.greatcleanjokes.com/180/yo-mama-joke-2/', 1),
(45, 'The Fat Fat Mama Joke', 'yo mama is so fat that when she steps on the scale it says to be continued.\n', 4, 133, 0, 'http://www.greatcleanjokes.com/177/yo-mama-joke/', 0),
(46, 'The Ugly Mama Joke', 'Yo mama is so ugly that they push her face into dough to make gorilla cookies.\n', 3.9, 98, 0, 'http://www.greatcleanjokes.com/167/knock-knock-joke-2/', 2),
(47, 'The Mail Box Joke', 'Yo momma is so dumb, she runs out and checks her mail box every time AOL tells her, “You’ve got mail!”\n', 3.2, 147, 0, 'http://www.greatcleanjokes.com/121/yo-mama/', 1),
(48, 'Medical History Joke', 'Due to a job transfer, Brian moved from his hometown to New York City.  Being that he had a very comprehensive health history, he brought along all of his medical paperwork, when it came time for his first check up with his new Doctor.\nAfter browsing through the extensive medical history, the Doctor stared at Brian for a few moments and said, ” Well there’s one thing I can say for certain, you sure look better in person than you do on paper!”\n', 3.4, 26, 0, 'http://www.greatcleanjokes.com/3802/medical-history-joke/', 0),
(49, 'Hypochondriac Joke', 'Brian, one of the worlds greatest hypochondriacs, bumped into his Dr. one day at the supermarket.  \n“Doc!” Brian exclaimed, “I’ve been meaning to tell you, remember those voices I kept on hearing in my head?  I haven’t heard them in over a week!”  \n“Wow!  What wonderful news Brian! I’m so happy for you!” his Dr. exclaimed.  \n“Wonderful?” asked a dismal looking Brian.  “There’s nothing wonderful about it. I’m afraid my hearing is starting to go now!\n', 3.7, 45, 0, 'http://www.greatcleanjokes.com/3482/hypochondriac-joke/', 1),
(50, 'Alcohol Joke', 'Doctor: “I am not exactly sure of the cause. I think it could be due to alcohol.”\nPatient: “That’s OK. I will come back when you are sober.”\n', 3.4, 55, 0, 'http://www.greatcleanjokes.com/3153/alcohol-joke/', 0),
(51, 'Enjoy Life Joke', 'Sam goes to the doctor for his yearly checkup. “Everything is fine”, said the doctor, “You’re doing OK for your age.” “For my age?” questioned Sam, “I’m only 75, do you think I’ll make it to 80? “Well” said the doctor, “do you drink or smoke?” “No” Sam replied. “Do you eat fatty meat or sweets?” “No” said Sam “I am very careful  about what I eat.” “How about your activities? Do you engage in thrilling behaviors like speeding or skiing? “No” said Sam taken aback, “I would never engage in dangerous activities.” “Well,” said the doctor, “then why in the world would you want to live to be 80?\n', 3.3, 140, 0, 'http://www.greatcleanjokes.com/2731/enjoy-life-joke/', 5),
(52, 'Worried Mom Joke', 'Mother – I need to speak to the doctor, it’s an emergency, my infant has a temperature of 101.\nDoctor to Secretary – Find out how she’s taking the temperature.\nSecretary – How are you taking it?\nMother – Oh, I’m holding up OK.\n', 2.5, 118, 0, 'http://www.greatcleanjokes.com/2576/worried-mom-joke/', 0),
(53, 'Eye Doctor Joke', 'I was very scared about going to the eye doctor to get a certain procedure done on my eyes. The doctor tried to put me at ease but to no avail. It was after he finished with my first eye that I nearly jumped out of the chair. “There there”, he said “only one eye left!”\n', 2.5, 152, 0, 'http://www.greatcleanjokes.com/2503/eye-doctor-joke-2/', 4),
(54, 'Alzheimer’s Joke', 'So this old man goes to the doctor and the doctor says, “You’re test\nresults came back and I’m afraid I have some bad news. You have Cancer\nand you have Alzheimer’s”. The old man says, “That ain’t so bad, at\nleast I don’t have Cancer!”\n', 3.2, 127, 0, 'http://www.greatcleanjokes.com/2441/alzheimers-joke/', 0),
(55, 'Blood Pressure Joke', 'A doctor remarked on his patients, ruddy complexion. “I know” the patient said “It’s high blood pressure, it’s from my family. “Your mother’s side, or father’s side?” questioned the doctor. Neither, my wife’s. “What?” the doctor said “that can’t be, how can you get it from your wife’s family?” “Oh yeah,” the patient responded, “You should meet them sometime!”    \n', 3.1, 83, 0, 'http://www.greatcleanjokes.com/1581/blood-preasure-joke/', 0),
(56, 'Just Being Practical', 'A man wasn’t feeling well so he went to the doctor.  After examining him the doctor took his wife aside, and said, “your husband has a very sensitive heart. I am afraid he’s not going to make it, unless you treat him like a king, which means you are at his every beck and call, 24 hours a day and that he doesn’t have to do anything himself. On the way home the husband asked with a note of concern “what did he say?” “Well”, the lady responded, “he said it looks like you probably won’t make it.”\n', 4, 102, 0, 'http://www.greatcleanjokes.com/1339/just-being-practical/', 2),
(57, 'Pregenant?', 'A lady went to a doctor’s office where she was seen by a Doctor. A few minutes into the examination, screeching could be heard from the room, and then the lady burst out of the room as if running for her life. After much effort a nurse finally managed to calm her down enough to tell her story. The nurse barged into the office of the Doctor and screamed, “shame on you, Mrs. Smith is 82 years old, and you told her she’s pregnant.” The Doctor continued writing calmly and barely looking  up said, “does she still have the hiccups?”\n', 3.9, 87, 0, 'http://www.greatcleanjokes.com/501/pregenant-doctor-joke/', 1),
(58, 'The Revenge On The Doctor', 'A colleague and I were fitting clothes for a fashion show benefit. All the models were residents of our small town, including the local doctor. He tried on one outfit and then asked, “what should I do next?” gleefully seizing the  opportunity my friend replied, “go to the dressing room remove your clothes put on a paper robe and wait.”  -Terry L. Roschak\n', 2.6, 71, 0, 'http://www.greatcleanjokes.com/59/funny-story/', 0),
(59, 'Injury Joke', 'Did you here about the guy who lost his whole left side?\nHe’s alright now!\n', 3.8, 411, 0, 'http://www.greatcleanjokes.com/2276/injury-joke/', 1),
(60, 'Nervous Dad Joke', '“Just relax”, the hospital staff kept telling Jim, but it was to no avail. Jim’s wife was in labor and Jim was a nervous wreck. After what seemed like a week, to both Jim and the hospital staff, a nurse came out with the happy news, “it’s a girl”, she cried. “Thank G-d, a girl”, said Jim, “at least she won’t have to go through what I just went through!”\n', 3.4, 84, 0, 'http://www.greatcleanjokes.com/2695/nervous-dad-joke/', 4),
(61, 'Iron Joke', 'A blond man entered the emergency room with his two ears burned. “What happened?” asked the doctor. “Well”, the man explained, “my wife was ironing clothing, behind my chair while I was watching TV. She put down the iron next to the phone and when the phone rang I answered the iron.” \n“Wow that is terrible” responded the doctor, and what happened to your other ear?” \n“Well” the blond guy responded “Right afterwards, the phone rang again!”  \n', 3.6, 151, 0, 'http://www.greatcleanjokes.com/1584/1584/', 1),
(62, 'Poor Husband Joke', 'Sally walked in to the Dentist office to make an appointment. “How much do you charge to pull out a tooth?” She asked.” “It’s $130″, was the prompt reply. “$130!” gasped Sally, that’s ridiculous! There must be a way for you to go cheaper.” “Well,” said the Dentist thoughtfully, I suppose if we don’t numb it, we could knock off $30.” “Only $30?,” countered Sally, “that’s still $100, you’ve got to make it cheaper.” “Well,” said the Dentist after a long pause, “I suppose if we take it out with a wrench we could knock it down to $50.” “Perfect”, said Sally happily. “I would like to make an appointment for next Tuesday, for my husband Jack.”\n', 3.7, 80, 0, 'http://www.greatcleanjokes.com/2852/poor-husband-joke/', 6),
(63, 'Old Age Joke', 'An Old man went to the doctor complaining of a terrible pain in his leg. “I am afraid it’s just old age”, replied the doctor, “there is nothing we can do about it.” “That can’t be” fumed the old man, “you don’t know what you are doing.” “How can you possibly know I am wrong?” countered the doctor. “Well it’s quite obvious,” the old man replied, “my other leg is fine, and it’s the exact same age!”         \n', 3.5, 169, 0, 'http://www.greatcleanjokes.com/1590/old-age-joke/', 1),
(64, 'Being Polite Joke', 'I work as a  pediatric nurse, and often have the painful job of giving shots to the children. One day upon  entering  the examining room to give a shot the  little girl starting screaming “NO! NO! NO!”\n“Jessica” her mother scolded, “that is not polite behavior!”\nAt that the girl continued to scream “NO THANK YOU! NO THANK YOU! NO THANK YOU!”\n', 3.6, 172, 0, 'http://www.greatcleanjokes.com/1588/being-polite-joke/', 5),
(65, 'OOPS?', 'Jerry was in the hospital recovering from  surgery when a nurse asks him how he is feeling.\n“I’m OK but I didn’t like the four-letter-word the doctor used in surgery,” he answered.\n“What did he say,” asked the nurse.\n“OOPS!”\n', 3.7, 160, 0, 'http://www.greatcleanjokes.com/1579/oops/', 5),
(66, 'Best Friend Joke', 'Mark was passing by the bar on the way home from  work when he sees his good friend Tom gulping down one shot after another.\nFearing the worst, Mark charged into the bar and confronted Tom.\n“Tom what’s going on?” Mark asked.\n“It’s my wife Beckie,” Tom replied. “She ran off with my best friend!”\n“Hey wait a second! Said Mark “Aren’t I your best friend?”\n“Not any more,” Tom said with a happy smile.\n“He is!”\n \n \n', 3.1, 63, 0, 'http://www.greatcleanjokes.com/3535/best-friend-joke/', 0),
(67, 'Bar Excuse Joke', 'Harry was sick and tired of being constantly badgered by his wife Barbara for spending so much time at the bar. Hoping it would help matters, Harry invited Barbara along with him.\n“So what would you like?” Harry cordially asked, as she took her seat next to him. “Oh I don’t know” Barbara replied, “I guess I’ll take the same thing as you.”\n“OK” said Harry to the bartender, “we’ll take two Johnny Walker’s on the rocks!”\nBarbara barely took a sip of the drink before she started gagging “Oh my gosh! Get me a cup of water! This stuff is horrible! How do you drink this garbage?”\n“See?” said Harry “and you think I come here just to have a good time?!“\n', 3.1, 46, 0, 'http://www.greatcleanjokes.com/3332/bar-excuse-joke/', 0),
(68, 'Parrot Joke', 'So this Chinese fellow walks into a bar with a huge colorful parrot on his shoulder. “Wow”, says the bartender, “where did you get that from?” “From China”, answered the parrot, “they’ve got tons of them there!” \n', 3.2, 86, 0, 'http://www.greatcleanjokes.com/2735/parrot-joke/', 0),
(69, 'Mushroom Bar Joke', 'A mushroom walks into a bar and orders a drink.\nThe bartender tells him to get out.\nThe mushroom says, “why? I’m a fun-guy.”\n', 2.9, 97, 0, 'http://www.greatcleanjokes.com/2644/mushroom-bar-joke/', 3),
(70, 'Ouch Joke', 'Two guys walk into a bar. The third one ducks.\n', 3.2, 43, 0, 'http://www.greatcleanjokes.com/2450/ouch-joke/', 0),
(71, 'The Bar Joke', 'A man walks into a bar obviously stone drunk, and asks for a drink. Sorry the bartender but you obviously already had a little to much to drink. Fuming mad the drunk walks out the front door and walks into the side door. “Can I have a drink please.”  “Sorry” the bartender says “but you can’t have a drink here.” The drink walks out and goes in through the back door. “Can I please have a drink.” “Enough!” The bartender screamed “I told You No Drinks!” The Drunk looks at the bartender closely and exclaimed “Darn! how many bars you work at.”   \n', 3.6, 150, 0, 'http://www.greatcleanjokes.com/615/confused-drunk/', 2),
(72, 'Cold Turkey Joke', 'Lady – “So do you drink?”\nMan – “I used to drink a lot, but I quit cold turkey.\nLady – “Wow, that must take a lot of self control.”\nMan – “Well I found out I was allergic to it, every time I drank I broke out in handcuffs.”\n', 3.1, 50, 0, 'http://www.greatcleanjokes.com/2689/cold-turkey-joke/', 1),
(73, 'Beer Beer Beer Joke', '24 hours in a day … 24 beers in a case …coincidence?\n', 2.8, 36, 0, 'http://www.greatcleanjokes.com/2259/beer-beer-beer-joke/', 0),
(74, 'Cooler Joke', 'Men are like coolers – Load them with beer, and you can take them anywhere.\n', 2.8, 20, 0, 'http://www.greatcleanjokes.com/2105/cooler-joke/', 0),
(75, 'Balanced Diet Joke', 'Q. What’s a man’s idea of a balanced diet?\nA. Beer in each hand!\n', 3.5, 17, 0, 'http://www.greatcleanjokes.com/2044/balanced-diet-joke/', 0),
(76, 'Beauty Joke', 'Beauty is in the eye of the beer holder. \n', 3.6, 15, 0, 'http://www.greatcleanjokes.com/1988/beauty-joke/', 0),
(77, 'What Do Beer And Women Have In Common?', 'Scientists recently discovered that beer contains small traces of female hormones. This was proven by giving 100 men 12 pints of beer and observed that an astonishing percentage, 100%, started  talking nonsense and couldn’t drive.\n', 3.6, 93, 0, 'http://www.greatcleanjokes.com/1632/what-does-beer-and-women-have-in-common/', 2),
(78, 'Snail Joke', 'Tom’s wife was hosting a dinner party for some of her close friends, at their summer home.  Moment’s before the guests were scheduled to arrive, she asked Tom if he would be ever so gracious to walk a block down to the beach to pick up some fresh snails for the party.  On his way to the beach he passed the local bar, and figured he’d stop in for a quick drink before heading down to the beach to search for the snails.  \nOne drink lead to the next, and before he knew it, it was 5:00 in the morning and he hadn’t gotten his wife those snails.  \nQuickly he hurried down to the beach, picked up a few snails, rushed home, and stumbled up the front steps, dropping the snails.  \nAt that moment, his wife angrily opened the door asking him where he had been and how he had ruined her party.  \nTom, looked towards the snails and said “C’mon you slow pokes!  Just a few more steps and we’re there!”\n', 3.9, 47, 0, 'http://www.greatcleanjokes.com/3382/snail-joke/', 0),
(79, 'Cemetery Joke', '‘Bob’s Tavern’ was right next door to a cemetery. One day in mid winter a drunk stumbled out of the tavern. Due to his drunk state he wasn’t careful where he was going and he fell into a freshly dug grave. “Help!” Screamed the drunk on the top of his lungs, “I’m freezing!”\nBefore long another drunk sauntered out of the tavern and made his way towards the first drunk’s cries. “I’m freezing!” Screamed the first drunk again. \n“Of course you are” scolded the second drunk, coming closer. “You kicked off all of the dirt they had covered you with!”\n', 4, 22, 0, 'http://www.greatcleanjokes.com/3326/cemetery-joke/', 0),
(80, 'Drunkard Joke', 'The poor man was such a habitual drinker that even he was finally convinced that he was an alcoholic . At his family’s urging he went to see a psychiatrist. After a lengthy consultation, the doctor sternly ordered that hereafter, every time the patient got drunk he was to report his transgression the very next day.\nA few days later the patient staggered into the psychiatrist’s office.\n“I wanna report that I wash drunk last night,” he mumbled.\n“For heaven’s sake, man, you’re drunk right now! ”cried the doctor.\n“Yeah I know,” said the patient, “but I’m gonna report this tomorrow.”\n', 4, 20, 0, 'http://www.greatcleanjokes.com/3195/drunkard-joke/', 0),
(81, 'Nasty Wife Joke', 'A cop pulled over a car and finds a young couple in the front seat.  “Where’s your seat belt young man?” asked the cop.  “Oh, I just took if off now when you were walking up to the car”, responded the man.  “No you didn’t!” exclaimed his wife, “you never wear your seat belt!”.  A little taken aback, the cop asked to see his license.  “Aw shucks!” cried the man, “I must have left it home!” “Yeah right!” screamed his wife, “You know it expired 3 months ago!”  At a loss for words, the cop asked the woman “are you always so tough on him?!” “No” responded the young woman, “only when he had too much to drink!”.\n', 3.2, 42, 0, 'http://www.greatcleanjokes.com/3001/nasty-wife-joke/', 0),
(82, 'Walk The Line Joke', 'A cop is doing standard patrol when he notices a car swerving all over the road. He quickly turns on his siren and pulls the guy over. “Alright,” says the cop, when the man gets out of the car. “Walk in a straight line.” “I’d be happy to,” says the drunk “just stop moving the stupid line.”\n', 3.9, 110, 0, 'http://www.greatcleanjokes.com/2727/walk-the-line-joke/', 5),
(83, 'Crazy Drunk Joke', 'Jeff was fast asleep in his at bed at 3:00 am when he heard an urgent knocking at the door. Rubbing the sleep out of his eyes he made his way to the door. “Can you give me a push”, asked the man at the door.” Jeff looked at the man, thinking he looked a bit drunk, slammed the door in his face and went back to bed. “Shame on you”, said his wife Sally, when hearing the story. “You remember on our vacation how our car got stuck in the middle of the night and that man helped us, go out there and push his car.” So Jeff trudges back out of bed, opens the door, and calls out “Ok I’m here to give you a push, where are you?” I’m over here in the back” came the voice “on the swing.”\n', 3.4, 134, 0, 'http://www.greatcleanjokes.com/2706/crazy-drunk-joke/', 5),
(84, 'Funny Throwing Up Video', '\n', 3.3, 28, 0, 'http://www.greatcleanjokes.com/2692/funny-throwing-up-video/', 1),
(85, 'Drunk Driving Joke', 'Jim’s car is swerving all over the road so a cop pulls him over, “Step out of the car” says the cop, “I am going to need you to take a  breathalyzer test.” “I can’t”, Jim responds “You see I have very bad asthma, that can set off an attack.” \n“Alright,” says the cop, “then you’re going to have to take a blood test.” “Can’t do that either,” Jim responds, “I am a hemophiliac, if a wound is opened, I won’t stop bleeding, and I could bleed to death.” \n“Ok,” the cop answers “then I will need a urine sample.” “Sorry,” says Jim “I also have diabetes, that could push my sugar count really low.” \n“Fine, so just come on out, and walk a straight line for me.” “Can’t do that either” responds Jim. “Why not?” Demanded the exasperated cop. “Well, because I’m drunk!”\n', 4.1, 350, 0, 'http://www.greatcleanjokes.com/2658/drunk-driving-joke/', 10),
(86, 'Ice Cream Joke', 'A drunk man walks out of a bar and sees an ambulance speeding down the street with it’s sirens blaring. The drunk man dashes  after the ambulance at full speed, finally collapsing on the floor, two blocks later. The man then looks at the ambulance speeding away, and screams on the top of his lungs, “I don’t care, keep your  stupid ice cream.”\n', 3.3, 55, 0, 'http://www.greatcleanjokes.com/2530/ice-cream-joke/', 0),
(87, 'I’m Not Drunk Joke', 'Bumper Sticker – I’m not as think as you drunk I am.\n', 3.4, 68, 0, 'http://www.greatcleanjokes.com/2226/im-not-drunk-joke/', 14),
(88, 'One Tracked Mind', 'A drunk man was in front of a judge. The judge says, ‘ Sir you’ve been  		brought here for drinking.’\nThe drunk says: ‘Okay, let’s get  		started.’\n', 3.8, 43, 0, 'http://www.greatcleanjokes.com/146/short-joke-7/', 0),
(89, 'The Confused Drunk', ' A drunk phoned the local police department to report that thieves had been in his car. “They have stolen the dashboard, the steering wheel, the brake pedal, even the accelerator,” he cried out. However, before the police investigation could start, the phone rang a second time, and the same voice came over the line. “Never mind,” the drunk said with a hiccup. “I got in the back seat by mistake.”\n', 4.1, 93, 0, 'http://www.greatcleanjokes.com/113/short-joke-6/', 3),
(90, 'Wife Shopping Cartoon', '\nMan – Hey! Can I talk to you?\nWomen – Me?\nMan – Yeah…Just for a minute.\nIt’s the only way to get my wife to stop shopping.\nStrike up a conversation with a pretty lady.\n', 4, 4, 0, 'http://www.greatcleanjokes.com/4015/wife-shopping-cartoon/', 0),
(91, 'The Helpful Husband Cartoon', '\n\nWife – I’m only 40 years old but I look like I’m over 55. My face is all wrinkly, my back is bent over, and my hair i stating to thin!\nHusband – At least your eyesight seems to still be working fine!\n \n', 4.2, 6, 0, 'http://www.greatcleanjokes.com/4009/helpful-husband-cartoon/', 0),
(92, 'Kiss Cartoon', '\nWife – Our neighbor Mr. Smith kisses his wife every day before he goes to work how come you never do?\nHusband – Honey!? How could I? I don’t even know her!\n', 3.8, 12, 0, 'http://www.greatcleanjokes.com/4006/kiss-cartoon/', 0),
