(136, 'Worlds Best Riddles', '1. Johnny ‘s mother had three children. The first child was named April The second child was named May. What was the third child ‘s name?\n2. There is a clerk at the butcher shop, he is five feet ten inches tall, and he wears size 13 sneakers. What does he weigh? \n3. Before Mt. Everest was discovered, what was the highest mountain in the world? \n4. How much dirt is there in a hole that measures two feet by three feet by four feet?\n5. What word in the English Language is always spelled incorrectly?\n6. Billy was born on December 28th , yet his birthday is always in the summer. How is this possible? \n7. In California , you cannot take a picture of a man with a wooden leg. Why not?\n8. What was the President ‘s Name in 1975? \n9. If you were running a race, and you passed the person in 2nd place, what place would you be in now?\n10. Which is correct to say, “The yolk of the egg are white” or “The yolk of the egg is white”? \n11. If a farmer has 5 haystacks in one field and 4 haystacks in the other field, how many haystacks would he have if he combined them all in another field? \n', 3.9, 655, 0, 'http://www.greatcleanjokes.com/3266/worlds-best-riddles/', 0),
(137, 'Best Riddle Of All Time!', 'So Joe was once again caught lying to his teacher, and his teacher Mr. Rogers had  enough. “Come here Joe” he said. “Here is your punishment, I want you to make a statement, if it’s true you get detention, if it’s false you get suspended.”\nQ. What did the Joe say that caused him not to get punished at all?\n', 3, 484, 0, 'http://www.greatcleanjokes.com/2945/best-riddle-of-all-time/', 0),
(138, 'Pinocchio’s Nose Riddle (Think)', 'Q. What happen’s if Pinocchio says my nose is about to grow???\n', 3.2, 579, 0, 'http://www.greatcleanjokes.com/2862/pinocchios-nose-riddle-think/', 9);
