(180, 'Cristmas Musings', 'Q. Why is Christmas just like a day at the office?\nA. You do all the work and the fat guy with the suit gets all the credit.\n', 4.2, 99, 0, 'http://www.greatcleanjokes.com/1820/cristmas-musings/', 1),
(181, 'Senile Joke', 'The nice thing about being senile is you can hide your own Easter eggs.\n', 3, 44, 0, 'http://www.greatcleanjokes.com/1744/senile-joke/', 0),
(182, 'Football Turkey Joke', 'A Football team was on the field during practice, when to their surprise, a big turkey suddenly walked up to the coach and demanded a tryout. “Are you crazy,” hollered the coach, “we don’t give tryouts to turkeys.” Before he knew it the turkey started dashing towards the football and made a fantastic catch. “That was amazing”, exclaimed the coach “I have never seen anything like that! How much do you want for a year?” “Don’t worry about  money,” said the turkey, “let me just ask you something, does the season go past thanksgiving?!”\n', 3.3, 24, 0, 'http://www.greatcleanjokes.com/2496/football-turkey-joke/', 2),
(183, 'Stuffed Turkey Joke', 'Q: Who is not hungry at Thanksgiving?\nA: The turkey because he’s already stuffed!\n', 4.1, 36, 0, 'http://www.greatcleanjokes.com/2493/stuffed-turkey-joke/', 0),
(184, 'Turkey Joke', 'Q.Why can’t you take a turkey to church?\nA.Because they use such FOWL language!\n', 3.6, 19, 0, 'http://www.greatcleanjokes.com/1822/turkey-joke/', 0),
