(201, 'What’s your favorite corny joke?', 'Do you know a corny joke that you think there is just nothing more funny, nothing more corny than,  in the entire world?  Post your favorite corny joke in the comments  and see what everyone else thinks of it!\n', 2.9, 112, 0, 'http://www.greatcleanjokes.com/3719/really-good-corny-joke/', 3),
