(278, 'Grandma Joke', '“Hi! My name is Gertrude,” said the lady next to him on the plane.  ”It’s so nice to meet you! I’m flying to New York for my grandson’s third birthday. I’m so excited! I remember when he was just a little thumbkin and now he’s already three!  It’s really hard to believe. He’s the most adorable thing you’ve ever seen! You know what?  Hold on, I think I might have a picture on me.  Let me take a look in my purse, yes, here it is, just look at him, isn’t he adorable. Do you see his dimple on his left cheek? Simply adorable! I could stare at his picture all day.\nOh my, and you should hear him on the phone!  He is just the cutest, he says to me in the cutest voice “Hi Grandma!” It just gets me all teary eyed.”\nAfter what seemed like two hours for the poor man sitting next to her, Gertrude seemed to realize that perhaps she was talking a bit too much. “You know, I feel terrible! Here I am just talking and talking without letting you get in a word edgewise!\n', 2.5, 245, 0, 'http://www.greatcleanjokes.com/3594/grandma-joke-3/', 0),
(279, 'Dead Dog Joke', 'Joe was a steward for Fly High airlines. He watched as an older lady boarded the plane holding a dog in a cage. “Excuse me,” said Joe “dogs are not allowed on board, you have to check it in with the baggage.” The lady wasn’t happy, but Joe was an experienced steward and succeeded in convincing the lady without much of a scene.  Upon arrival, Joe took a peek in the cage, and to his great surprise, saw that the dog was dead! Frantic that they may get sued, Joe quickly sent one of his underlings out to town to buy a dog that looked exactly the same. Just in the nick of time the underling arrived with the dog  They quickly switched dogs and breathed a sigh of relief. “This isn’t my dog!” said the lady as soon as she saw it. “I’m sure it is” insisted Joe “I was very careful about where I put it.” “It’s not my dog” argued the lady, “you see, I was bringing my dog to my home town to have him buried, and this dog is alive!”\n', 3.6, 27, 0, 'http://www.greatcleanjokes.com/3004/dead-dog-joke/', 0),
(280, 'Flying Joke', 'Larry was a photographer for the N.Y. Times, and was scheduled to meet a plane on the runway to take him on a job. “Hit it,” said Larry climbing into the first plane he saw on the runway. The pilot took off, and was soon in the air. “OK,” said Larry, “fly low over the trees over there, I want to take a few pictures.” “What do you mean?” asked the pilot. Larry looked at the pilot and answered a little annoyed, “I need to take some pictures for the N.Y. Times, so please…..”   There was a long pause, before the pilot asked in a shaky voice, “you mean you’re not my pilot instructor?”\n \n', 4.2, 48, 0, 'http://www.greatcleanjokes.com/2744/flying-joke-2/', 1),
(281, 'No Smoking Joke', 'A Stewardess upon noticing  that someone  clearly has been smoking in the bathroom. “I’m sorry sir” she said “but you’re not aloud to smoke on the plane,  if you want to smoke again please step out!”\n', 2.9, 56, 0, 'http://www.greatcleanjokes.com/820/no-smoking-means-no-smoking/', 0),
(282, 'Birthday Invitation Joke', 'Birthday Invitation:\nWhat?  You are invited to Cathy’s birthday party.\nWhere?  1424 Maple Dr. (you will need to be buzzed in, so dial our number with your nose and you will then be buzzed in. Once, you’re in the building, press the button for the elevator with your nose. Then press floor number 12 with your nose. We are the door on the left hand side.)\nCan’t wait to see you!\nP.S. You will be pushing with your nose, because your hands will be too busy holding the presents.\n', 2.4, 114, 0, 'http://www.greatcleanjokes.com/2631/birthday-invitation-joke/', 1),
(283, 'Happy Birthday Joke', 'After much convincing from my husband, I finally agreed to call an old family friend to sing her happy birthday. It was only after I finished singing, that the voice at the other end of the line informed me, that it was the wrong number.\n“Oh I’m sorry” I said, embarrassed. “It’s ok”, the voice said “you can use all of the practice you can get!” \n', 3.3, 69, 0, 'http://www.greatcleanjokes.com/1949/happy-birthday-joke/', 0),
(284, 'Kids And Fish Joke', 'For our daughters 6th birthday we bought her a fish. We couldn’t help laughing when on the way she announced “the fish’s name is Sparingly.” “How do you know?” I asked “look” she responded “it says “feed sparingly 3 times daily.” \n', 3.6, 85, 0, 'http://www.greatcleanjokes.com/1504/kids-and-fish-joke/', 0),
(285, 'Cold Shoulder Joke', 'Hey, you didn’t have to give me the cold shoulder!”\nSaid the cannibal who was late for dinner.\n', 3.8, 14, 0, 'http://www.greatcleanjokes.com/3314/cold-shoulder-joke/', 0),
(286, 'Cannibal Eating Joke', 'Two Cannibals were eating a clown. One Cannibal Turned to the other\nand asked, “Does This taste a bit funny to you?”\n', 3.5, 37, 0, 'http://www.greatcleanjokes.com/2522/cannibal-eating-joke/', 0),
(287, 'Cannibal Cookbook', 'Cannibal Wife- Honey, why did you think I wanted a subscription to People Magazine?\nHusband- Oh I’m sorry dear I thought it was a cookbook.\n\nphoto credit: Thoth, God of Knowledge\n', 2.9, 31, 0, 'http://www.greatcleanjokes.com/773/cannibal-cookbook/', 1),
(288, 'The Cannibal Supper Table', 'Cannibal Husband-I don’t like your Mother.\nCannibal Wife- Try the potatoes.\n', 3.9, 19, 0, 'http://www.greatcleanjokes.com/764/the-cannibal-supper-table/', 0),
(289, 'Cannibal Soup?', 'Two cannibals were having supper. “Your wife makes great soups” said one to the other. “Yes” agreed the first, “but I am going to miss her terribly.”\n', 3.7, 21, 0, 'http://www.greatcleanjokes.com/760/good-food/', 0),
(290, 'Money Problems Joke', 'When the lodge meeting broke up, John confided to a friend. “Mike, I’m in a terrible pickle! I’m strapped for cash and I haven’t the slightest idea where I’m going to get it from!” “I’m glad to hear that” answered Mike. “I was afraid you might have an idea you could borrow it from me!”\n', 3.7, 15, 0, 'http://www.greatcleanjokes.com/3166/money-problems-joke/', 0),
(291, 'Stock Market Joke', 'Q. What’s the best way to make a small fortune in the stock market?\nA. Start off with a big one!\n', 2.8, 35, 0, 'http://www.greatcleanjokes.com/2342/stock-market-joke/', 0),
(292, 'Poor Economy Joke', 'I met a guy who’s a walking economy the front of his hair is in recession, his stomach is a terrible victim of inflation, and the combination together are putting him into a deep depression!\n', 2.6, 32, 0, 'http://www.greatcleanjokes.com/663/times-are-tough/', 2),
(293, 'Hot Cakes', 'The economy is so bad, hot cakes aren’t even selling like  hot cakes anymore.                                                                                          Buzz Nutley\n', 4, 8, 0, 'http://www.greatcleanjokes.com/462/hot-cakes-economy-jokes/', 0),
(294, 'Leftovers Joke', '“Oh no! not leftovers again!” complained my older sister when she saw the leftover meatloaf on the table from last nights supper.\n“Young lady” responded my father sternly, “do you know how many people would love to have a delicious supper like this?! You should be ashamed of yourself! Now before we start eating I want to hear you say grace thanking the Lord for this delicious meal!”\n“Thank you Lord for this delicious supper”, muttered my sister submissively “….again!”\n \n', 2, 62, 0, 'http://www.greatcleanjokes.com/3986/leftovers-joke/', 0),
(295, 'Restaurant Joke', 'Sarah, Rosemary, and Anne went to a restaurant together to celebrate old times.\n“I’ll take some Tom Yum soup” said Sarah to the waiter. “Nah” said the waiter waving his hand “you probably won’t like it, it’s way too spicy! Why don’t you  try the Garden Vegetable Soup?  ”Alright,” said Sarah. “You know better than me, after all you are the waiter!”\n“And how about you Ma’am?” said the waiter turning to Rosemary. “I think I’ll take the poached fish,” said Rosemary, after carefully examining the menu.  ”I don’t really think you’ll like it,” said the waiter, “it’s very bland. Why don’t you try the Rib Steak with Garlic Marinade? “OK, I’ll take that instead,”  said Rosemary.\n“And how about you?” said the waiter turning to Anne. “I don’t know, I can’t decide,” said Anne looking up from the menu, “what do you recommend?”\n“Recommend?” said the waiter with a surprised look on his face, “who has time to recommend stuff smack in the middle of dinner hour!”\n', 2.8, 39, 0, 'http://www.greatcleanjokes.com/3528/restaurant-joke/', 0),
(296, 'Diet Joke', 'A group of prosperous businessmen were dining at the Sam’s Hotel in Las Vegas.\n“Seems to me you are getting a little slimmer,” remarked one.\n“I should be!” replied the other. “I went on one of those high protein diets. Nothing but expensive steaks and chops. And would you believe it?-in just two weeks I lost thirty dollars!”\n', 3.3, 19, 0, 'http://www.greatcleanjokes.com/3181/diet-joke/', 0),
(297, 'Raising Kids Joke', 'Sandy and Norman were in despair.  Their 3 year old son Timmy still had not learned how to talk.  Not a word had escaped through those now 3 year old lips.  One night at dinner, Timmy took a taste of his pie, and to their utter surprise and amazement, said: “You call this pie?  It tastes like some tasteless mush!”.  Sandy and Norman sat there in shock, for this was not just their son’s first sentence, but the first words he ever uttered!  Once the initial shock had subsided, Norman asked “tell me Timmy, how come you never spoke until now?”  “I never had any reason to” explained Timmy.  “Everything was always fine.”\n', 3.5, 23, 0, 'http://www.greatcleanjokes.com/2988/2988/', 0),
(298, 'Misunderstanding Joke', 'Jim was in a bad mood, and anyone who got in is way was going to regret it.  Jim walked into his favorite restaurant and plopped himself down on a chair.   “Get me a steak well done with mashed potatoes. ” Three minutes later when his order came, Jim screamed “DIDN’T YOU HEAR ME SAY WELL DONE?!” “Why thank you sir” the waitress smiled,  ”that was the first compliment I got all day!”\n', 3.3, 31, 0, 'http://www.greatcleanjokes.com/2963/misunderstanding-joke-2/', 0),
(299, 'Pork Joke', 'The leader of the vegetarian society just couldn’t control himself anymore. He just needed to try some pork, just to see what it tasted like. So one summer day he told his members he was going on a vacation. He packed out of town, and headed to the nearest restaurant. After sitting down, he ordered a roasted pig, and impatiently waited for his delicacy.\nAfter just a few minutes, he heard someone call his name, and to his great chagrin he saw one of his fellow members walking towards him. Just at that same moment, the waiter walked over, with a huge platter, holding a full roasted pig with an apple in it’s mouth.\n“Isn’t that something,” says the leader after only a moments pause, “all I do is order an apple, and look what it comes with!”\n', 3, 220, 0, 'http://www.greatcleanjokes.com/2603/pork-joke/', 4),
(300, 'A Drink Joke', 'Sam heard all about the great service in the “Sleep Fine Hotel”, so after dropping his stuff in his room, he excitedly headed down to the hotel lounge. He was only there for a few minutes when a beautifully dressed waiter came over to him. “Would you like something to drink?” she asked. Sam took in a deep breath, looked around at the beautiful lobby and asked “what are my choices?” The woman’s gave Sam a strange look, and responded in an extra loud and slow voice, “yeees or noooo.”\n', 3.1, 29, 0, 'http://www.greatcleanjokes.com/2845/a-drink-joke/', 0),
(301, 'Funny Drive Through Video', '\n', 4.3, 86, 0, 'http://www.greatcleanjokes.com/2661/funny-drive-through-video/', 3),
(302, 'Fries Joke', 'Man – “I would like some fries, please.\nBlonde at the counter – “Ok……………………… and would you like some fries with that?”\n', 2.8, 130, 0, 'http://www.greatcleanjokes.com/2331/fries-joke/', 0),
(303, 'Double Portion Joke', 'Waiting hungrily on the lunch line, I eyed the hamburgers being served. Upon reaching the front of the line I asked, “excuse me, can I please have two burgers.” “You’ll get the same as everybody else,” the lady said in a bored voice. After hungrily eating my lunch, I walked to the garbage to throw out my plate, but I accidentally dropped my lunch tray in the garbage along with it. While I was digging in the garbage for my tray I felt a tap on my shoulder. “I’m sorry sonny” the lady said in a horror-stricken voice, “ here is another burger.”\n', 2.9, 36, 0, 'http://www.greatcleanjokes.com/2316/double-portion-joke/', 0),
(304, 'Museum Joke', '“And this over here” croaked the 90 year old museum tour guide, “is a fossil 4 million and 69 years old, on it’s left you can see another fossil that’s 2 million and 69 years old.”\n“Wow! That’s really fascinating,” said a fellow in the audience, “how can you age it so accurately to the year?”\n“Well that’s simple” answered the old chap, “It was two million years old when I started working here 69 years ago.”\n', 3.4, 86, 0, 'http://www.greatcleanjokes.com/3238/museum-joke/', 0),
(305, 'Heat Joke', 'It was during a heat wave in August one summer when I saw this sign on a telephone pole. “Garage sale this Sunday 7AM until 100 degrees.”\n', 2.7, 139, 0, 'http://www.greatcleanjokes.com/1256/heat-joke/', 1),
(306, 'Used Clothing Joke', 'Always trying to save money, I often buy clothing for my kids from the garage sales. Recently, I purchased a new shirt from JC Penny for my 6 year old and was wondering why she was reluctant to wear it the next day. After asking her she responded,\n“Oh, the store has their own washing machine… that’s why we don’t have to wash it first?!”\n', 2.2, 61, 0, 'http://www.greatcleanjokes.com/693/used-clothing/', 0),
(307, 'Travel Joke', 'An older couple were walking on a beach when the husband tripped over a bottle and a genie came out. “You can each have one wish,” said the genie. The wife made her wish first “I would like to travel around the world, with my husband,”. Suddenly there appeared in her hand two tickets for travel around the world. Now it was the husbands turn, “Well” said the husband, with a naughty look on his face “I wish I can have a younger companion,” . The words were barely out of his mouth when poof, he aged 20 years! \n', 3.2, 62, 0, 'http://www.greatcleanjokes.com/2265/travel-joke/', 0),
(308, 'Mean Boss Joke', 'The CEO of a large company was walking to the cafeteria along with two of his secretaries.  Upon tripping on a bottle, a genie appeared and asked the threesome if they would like to each make a wish.  \nThe first secretary excitedly exclaimed,  “I wish I was on a beach in a tropical island!”  Immediately her wish was granted.  \nThe next secretary proclaimed,  “I wish I was on a tour of France!”  Immediately her wish too, was granted.  \nBeing that it was now his turn to make a wish the CEO exclaimed “I want the two of them back in their offices right after lunch!”\n', 3.4, 125, 0, 'http://www.greatcleanjokes.com/1418/boss-joke/', 0),
(309, 'Be Careful What You Wish For', 'A man rubbed a bottle and a genie came out, “OK the genie said what’s your wish” The man said “I want all ladies to love me”, and he turned into a bar of chocolate. \n', 4.2, 42, 0, 'http://www.greatcleanjokes.com/1104/be-careful-what-you-wish-for/', 2),
(310, 'Good Men Are Hard To Find!', 'A lady rubbed a bottle and a genie  popped out. “You have one wish” said the genie. “Hey” countered the lady “I thought I get three wishes?” “Not from  me” said the genie “I’m not that powerful.” “OK” responded the lady taking out a map, “I am making a wish for  peace between this country……… .” “I’m really sorry” said the genie,  “but I am not powerful enough for that.”  “That’s fine” said the lady, “instead I would like to find a cool, caring man, who loves children, and cooking.” The genie sighed and said “alright….. let me see that map again.”\n', 3.8, 56, 0, 'http://www.greatcleanjokes.com/1046/good-men-are-hard-to-find/', 0),
(311, 'Kiss Joke', 'I lovingly gave my niece a kiss on her cheek upon seeing her at a family get-together.  Afterwards, I noticed her wiping her cheek.  ”Are you wiping off my kiss?”, I asked her.  ”No”, she smartly replied, “I’m just rubbing it in!”\n', 3.3, 171, 0, 'http://www.greatcleanjokes.com/2651/kiss-joke/', 10),
(312, 'Back Seat Driver Joke', 'My daughter sure showed me what a back seat driver I am!  On our way to the mall today, I stopped short at a red light causing the car to jolt.  As soon as I jerked my 3 year old in the back seat hollered Daaaaave.  Not sure why she had called my husband’s name, I asked her why she had said what she did.  ”That’s what you say when someone stops like that”, she innocently replied.\n', 2.8, 72, 0, 'http://www.greatcleanjokes.com/2512/back-seat-driver-joke/', 0),
(313, 'Watch What You Say!', 'As a first grade teacher, I often hear from my students things going on in their family. Harry’s mother was expecting, and naturally Harry was very excited about it. When one day Harry stopped talking about it I was concerned and questioned him why. “Well”, Harry said, “my mother told me I could feel the baby moving in her stomach, I thing she ate it!” \n', 3.5, 157, 0, 'http://www.greatcleanjokes.com/1722/watch-what-you-say/', 1),
(314, 'A Word From The Wise Joke', 'When my grandson asked me how old I was, I teasingly replied, “I’m not sure…” “Look in your underwear, Grandma,” he advised, “mine says I’m 4 to 6.” \n', 3.8, 46, 0, 'http://www.greatcleanjokes.com/1707/a-word-from-the-wise-joke/', 4),
(315, 'The Missing Boots', 'As part of my job as a preschool teacher I have to help the children put on their coats and boots. One day when school was over and the children were getting ready to leave, one child came over to me in tears “my boots are missing” she wailed. “they are in the corner” I said pointing to her boots. “Those are not mine!” she said, stamping her foot, “MINE HAD SNOW ON THEM!” \n', 3.6, 57, 0, 'http://www.greatcleanjokes.com/1525/the-missing-boots/', 0),
(316, 'Playing Doctor Joke', 'My child Mike, was playing doctor with his friend Jim. “I’m so sick” said my son, “Can you please take a look at me.” “Sure” said Jim taking out his toy stethoscope, after a few seconds of listening closely to his heart, he said sadly, “Oh Mike, you have a broken arm! \n', 3.3, 61, 0, 'http://www.greatcleanjokes.com/1428/playing-doctor/', 0),
(317, 'Kids Fears Joke', 'I live in Canada, a plane ride away from my family, so I was very excited to inform my twin 3 year olds that we were going to go on a plane to see my family. It was after a few days that it struck me that they seemed nervous about it. After talking it over with them I finally figured out the problem. They thought they would each have to fly on a separate plane by themselves. How else would we all fit into one of those tiny planes that fly in the sky?\n', 3.2, 66, 0, 'http://www.greatcleanjokes.com/1416/kids-fears/', 0),
(318, 'What Do You Want To Be When You Grow Up?', 'I was a little surprised when my son suddenly announced one day after church, “I am thinking of being a Minister when I grow up.” “Why is that?” I asked. “Well, I figure I have to go to church on Sundays anyway, and I think it’ll be more fun to stand and yell then to just sit and listen.”\n', 3.7, 71, 0, 'http://www.greatcleanjokes.com/1032/what-do-you-want-to-be-when-you-grow-up/', 3),
(319, 'Twin Joke', 'I couldn’t help laughing when one of my identical granddaughters tried insulting the other one, “well your ugly!”\n', 3.2, 15, 0, 'http://www.greatcleanjokes.com/673/be-careful-what-you-say/', 0),
(320, 'Funny Therapist Video', '\n', 4, 45, 0, 'http://www.greatcleanjokes.com/2805/funny-therapist-video/', 6),
(321, 'The Cheaper Solution', 'A lady went to a psychiatrist complaining of a terrible phobia. “Every time I lay down on my bed I get this terrible fear that there is something underneath. “Wow” responded the psychiatrist “I’ve never heard of such a phobia, but like all phobias it can be treated, but it will likely take around 20 sessions.” “OK” responded the lady “how much is each session?” “Oh it’s just $80 a session, but trust me it’s well worth it.” When the lady didn’t come back to the  psychiatrist  he gave the lady a call. “How come I didn’t hear from you? He asked.” “Well” responded the lady “when I came home and told my husband about the cost he thought he would save some money, he just cut the legs off the bed!”\n', 3.4, 88, 0, 'http://www.greatcleanjokes.com/1273/the-cheaper-solution/', 4);
INSERT INTO `joke` (`id`, `title`, `content`, `rating`, `votes`, `likes`, `url`, `comments_count`) VALUES
(322, 'Speeding Ticket Joke', 'So there was this female business executive who was late for a meeting.\nShe is going 65 on a street where the speed limit is 40.\nA cop pulls her over and says “ma’am, can I please see your license?”\nShe says “I’m sorry, officer, but I got it revoked two years ago for drunk driving.”\nHis brow furrows and he straightens up. “Well, can I please see the registration of your car?”\nShe says “I stole the car and I killed the driver; he’s in the trunk.”\n“Ma’am, DON’T MOVE, I’m calling for backup.”\nHe mutters furiously into his walkie-talkie…\nFive minutes later, half the squad pulls up, the Chief of Police walks over to the woman’s window.\n“Ma’am, can I see your license?” he asks sternly.\n“Of course, officer,” she smiles demurely and pulls out a license from her purse.\nHe squints warily at it. “This looks legitimate,” he mumbles.\n“Can I see the registration to this car?”\nShe pulls it out of the glove compartment and hands it to him.\n“Ma’am, stand back!”\nHe bangs open the trunk of the car and flinches: but it was completely empty…\nThe woman brandishes a finger at the first cop and says accusingly, “And I’ll bet that liar told you I was speeding too!!”\n', 4.2, 96, 0, 'http://www.greatcleanjokes.com/3144/speeding-ticket-joke/', 0),
(323, 'Late Joke', 'I was upset but not too surprised when I saw flashing lights in my rearview mirror. “I’m terribly sorry officer” I said “I was just trying to make it to a meeting on time.” “That’s a shame” the officer said upon handing me my ticket, “what time is the meeting called for?” “Three o’clock” I said. The officer looked at his watch, “you could probably still make it if you hurry up!”\n', 2.6, 90, 0, 'http://www.greatcleanjokes.com/2285/2285/', 0),
(324, 'Which Game?', 'It was at a miniature golf course on a brutally hot day when I saw a father with 3 kids. “Who’s winning?” I asked cheerfully. “I am” said one “no, I am” said another. “No,” the father said “their mother is!” \n', 3.3, 20, 0, 'http://www.greatcleanjokes.com/1210/which-game/', 0),
(325, 'Cute Pick Up Line', 'OH MY GOODNESS!! You are not going to believe it, I saw the cutest thing in a store window. I was going to buy it for you but then I realized that it was my reflection!!\n', 4.4, 55, 0, 'http://www.greatcleanjokes.com/3498/cute-pick-up-line-2/', 0),
(326, 'Phone Number Pick Up Line', 'I lost my phone number…can i have yours?\n', 2.8, 52, 0, 'http://www.greatcleanjokes.com/2687/phone-number-pick-up-line/', 0),
(327, 'Feeling Pregnant Joke', '“Ok everyone,” said the the instructor at the birthing class trying to get everyone’s attention. “We are going to do an exercise now, that’s purpose is to  help the men sympathize with their partners.”\n“We have here what’s called a pregnancy suit,” said the woman instructor, holding up an artificial stomach with a strap.  ”This imitates the feeling of being pregnant.” Which Husband volunteers to be the first one to try it on?”\n“I will” said one man, taking the suit and trying it on.  ”This isn’t too bad said the man walking around. I think I could get used to this.” “Ok”, said the instructor smiling, “now I would like you to bend down and pick up my pen from the floor.”\n“You want me to pick it up?”  he said hesitantly,  ”just as I would if I was pregnant?” “Yes!” said the instructor.\n“Honey,” said the man turning to his spouse “do you mind picking up that pen for me?”\n', 3.8, 113, 0, 'http://www.greatcleanjokes.com/3733/feeling-pregnant-joke/', 0),
(328, 'Girl Friend Joke', '“Brian, what’s wrong with you? You’ve been sitting at your desk looking depressed for the last five minutes!” “Oh Dan,” responded Brian “I don’t know what to do! I got in a big fight last night with my Suzie, she claims I never buy her gifts, so I must not care about her!”\n“Brian, that’s horrible!” said Dan putting his arm around Brian. “What type of a gift does she want already?”\n“Well, right before she closed the door on my face she said to me: “Why don’t you show me how much you care about me? Why can’t you get me something that goes from 0 to 175 in seconds!”\n“Dan what should I do? I don’t have that kind of money? I can’t go out and buy her a car!”\n“A car? Asked Dan. “Who needs a car? Just stop by Target and buy her a scale!”\n', 4.1, 56, 0, 'http://www.greatcleanjokes.com/3486/girl-friend-joke/', 0),
(329, 'Sales Associate Joke', 'Sarah, a Sales Associate at Walmart, notices a man in the card section. When she walks by an hour later and sees him still there she walks over to see if she can help. “Can I help you?” she asks. “Well I don’t know” the man responds “I’m having a problem, I can’t find anything that my wife would believe!”\n', 3.6, 24, 0, 'http://www.greatcleanjokes.com/3334/sales-associate-joke/', 0),
(330, 'Son In Law Joke', 'Sam was the owner of a worldwide branch of stores and a multi-millionaire.\n When his daughter Sandy got engaged to a very religious young man he called the future Groom into his office. \n“So tell me,” said Sam, sitting the young man down. “What are your plans for the future?” \n“Well”, said the Groom. “I plan on studying holy works all of my life.”\n“And how exactly do you plan on supporting my daughter if you are studying all day?” questioned Sam. \n“I am sure The Lord will provide.” Answered the young man.\n“And what about your kids? How do you plan on supporting them?”\n“The Lord will provide” answered the young man again.\n“How did it go?” asked Sam’s wife after they finished talking.\n“It went great” Sam replied. “I had just met the young fellow and already he thinks I’m the Lord!”\n', 3.8, 22, 0, 'http://www.greatcleanjokes.com/3281/son-in-law-joke/', 0),
(331, 'The Man Of The House Joke', 'A man was married to a woman whose commands to her husband were as  sharp as the bite of a barracuda. \nIt wasn’t so much that he was a coward, or too timid to talk back, but you know how it is…let’s keep peace in the family.\nOne day the wife invited a group from the local women’s club to her house for tea and discussions.  To make sure that her husband did not interrupt the goings-on, she ordered him into the closet and sternly told him to stay there until the last lady had left.\nDuring their bridge game, the ladies of the club spoke of the authority they wielded over respective husbands.  Not to be outdone, the hostess informed the others that not only had she ordered her husband into the closet, but she could order him to come out, at will.  \n“I’ll prove it,” she boasted.\n“Bob!” she commanded, “come out of that closet!”\nNo response.\n“Bob!” she called in a louder voice, “come out of that closet this instant!”\nNothing.\n“Bob!” she screamed at the top of her lungs, “I order you to get out of that closet this instant!”\n“No, I won’t!” came her husband’s muffled cry from inside the closet.  “I’ll show you who’s boss in this house!”\n', 3.6, 28, 0, 'http://www.greatcleanjokes.com/3224/the-man-of-the-house-joke/', 0),
(332, 'Present Joke', 'John  gingerly walked up to the sales lady in the clothing store “I would like to buy my wife a pretty pink scarf. ” “How cute” exclaimed the sales lady,  ”sounds like it’s going to be a great surprise.” “It sure is” said John “she’s expecting a new car!”\n', 4.3, 20, 0, 'http://www.greatcleanjokes.com/2976/present-joke/', 0),
(333, 'A Husband Is Like A Bar Of Soap', 'In an effort to make our site more interactive we ask people to please add a line in the comment space. The top ten additions will be posted as part of the joke, the rest will be kept as comments. Enjoy!\nA Husband Is Like A Bar Of Soap…………\n\n1. A husband is like a bar of soap if you know how to use them they will help you clean if not they will slip away…\n- A.D.E.\n2. A husband is like a bar of soap, smells great, until you take a bite into it! – Sandy Green\n3.  A husband is like a bar of soap, smells great, but you have to be careful he doesn’t slip through your fingers.\n- Maria Smith\n4. Because they both slip away when overworked….., a husband however will always return for supper. – A. Scor\n5. Because they are both small. (Note: This only applies if your husband is small.) – C. Smith\n6. If you step on him, he’ll slip away and you’ll fall. – Jack Levin\n', 2.9, 25, 0, 'http://www.greatcleanjokes.com/2807/comparing-husband-joke/', 11),
(334, 'Death Preparation Joke', 'Barry and Hannah, an old married couple,  are sitting on the couch watching TV. On the show they were speaking about how to prepare in case of death etc. “Honey,” says Barry, turning to his wife with a serious expression, “I want you to promise me, that if there ever comes a time that I am dependent on just machines and bottled fluid, that you will make sure to  put an end to it.” “No problem hun,” said Hannah, and she promptly got up, turned off the TV, and poured his beer down the drain.\n', 3.8, 100, 0, 'http://www.greatcleanjokes.com/2761/death-preparation-joke/', 6),
(335, 'Flower Joke', 'Harry and Barbra’s marriage has been on the rocks for a while, so when they hear about a marriage seminar being given in their neighborhood they decide to attend. “One of the most important things in marriage”, said the speaker, “is to get to really know your spouse well. For example,” continued the speaker, “How many of you know what’s your wife’s favorite type of flower?” Harry leaned over to Barbara and whispered, “it’s gold medal all-purpose flour isn’t it?”\n', 3.8, 47, 0, 'http://www.greatcleanjokes.com/2737/flower-joke/', 2),
(336, 'Bye Bye Joke', 'My husband said it was him or the cat…I miss him sometimes.\n', 4, 24, 0, 'http://www.greatcleanjokes.com/2395/bye-bye-joke/', 0),
(337, 'Marriage Sports', 'A newly married couple went fishing on their vacation. Afterwards the wife’s mother asked her how it went. “Oh, it was terrible, everything went wrong, we overslept, and then we got a flat tire, and the worst part was that I caught more fish than he did! \n', 2.6, 61, 0, 'http://www.greatcleanjokes.com/1343/marriage-sports/', 0),
(338, 'The Real Secret To A Happy Marriage', 'Jerry was at a marriage seminar, and the leader of the seminar, a lady, was asking everybody how long they were married for. When it was Jerry’s turn Jerry said that he was married for almost 50 years. “Wow”  the leader gushed “that’s amazing, perhaps you can take a few minutes to share some insights with everybody, how you stay married to the same woman for so long. “Well,” Jerry said after thinking for a few moments, “I try to treat her nice, buy her presents, take her on trips…………. and best of all, for our 25th anniversary I took her to the Bahamas.” “Well that’s really beautiful, and a true inspiration for all of us” the lady said “maybe you can tell us what you are going to do for your 50th anniversary” she said with a smile “Well” Jerry said “I’m thinking of going back to the Bahamas to pick her up.”\n', 4.1, 212, 0, 'http://www.greatcleanjokes.com/885/the-real-secret-to-a-happy-marriage/', 3),
(339, 'Men Never Listen', 'My wife says I never listen to her………………………….or something like that.\n', 3.8, 14, 0, 'http://www.greatcleanjokes.com/89/marraige-humor/', 0),
(340, 'Be Careful Who You Marry', 'When I married MR. RIGHT, I didn’t know his first name was ALWAYS!\n', 3.7, 9, 0, 'http://www.greatcleanjokes.com/68/marrige-humor/', 0),
(341, 'Men? Romance?', 'After I waited patiently while my husband played a round of golf on our 18th wedding anniversary he and I went out to dinner at a lovely restaurant. We discussed many happy memories we’ve shared during the years. Then I said “Want to go for another 18?” “no” he  replied “I think it’s too dark now.” -Mary Leach\n', 4, 21, 0, 'http://www.greatcleanjokes.com/55/marriage-humor/', 0),
(342, 'Wife Insult Joke', '“Harry,” whined Mary, to her husband of 20 years. “What should I do?! I’m not ready for old age! I’m only 40 years old but I look and feel like I’m over 55! My face is all wrinkly, my back is bent over, and my hair is all thinned out.”\n“Well,” said Harry after looking her up and down, “There is one thing about you that still works as good as new.”\n“Oh Harry!” said Mary sitting down next to her husband, “you always know just what to say! What are you referring to?”\n“Never mind” said Harry looking down.\n“C’mon Harry, please tell me what you were referring to.”\n“Mary, please don’t make me.”\n“Harry I insist.”\n“Well I was going to remark about how your eyesight seems to be working just fine!”\n', 4.1, 55, 0, 'http://www.greatcleanjokes.com/3580/wife-insult-joke/', 0),
(343, 'Gambling Joke', 'John Sam and Abe, 3 retired friends,would get together every night, rain or shine, to play poker. It was a nice way to pass the time and the men enjoyed it immensely.\nJohn’s wife wasn’t so fond of her husband’s poker playing.  She thought it was a dirty and low way to fill his time, but she had long ago resigned herself to her sorry fate, although inside of her, there was  always a low flame on the back burner waiting to erupt.\nOne Wednesday night, after a few nights of boring games, something exciting happened.  Sam watched in amusement as John and Abe, each convinced that they had the better hand,  slowly put their life savings into the pot. Things started to get really intense when John, running out of available cash, added  his car and house into the pot.\nWhen there was no money left to bet on they each showed their cards.  As soon as John saw Abe’s cards and realized he had lost, he had a heart attack and died.\n“Sam,” asked Abe “how are we going to tell his wife?” “Don’t worry I’ll take care of it” Abe replied.\nAbe knocked on John’s door. “John just lost all of your life savings in a poker game,” said Sam when the door was opened. “He’s afraid to come home.”\nJohn’s wife was fuming “HE DID WHAT?!” She screamed. “TELL HIM I DON’T WANT TO EVER SEE HIS FACE AGAIN! TELL HIM TO JUST DROP DEAD!”\n“Ok,” said Sam nodding his head, “I’ll tell him just that!”\n \n \n', 3.8, 42, 0, 'http://www.greatcleanjokes.com/3531/gambling-joke/', 0),
(344, 'Marital Bliss Joke', '“So Grandpa” asked Dave at his engagement party “your marriage to Grandma is legendary everyone talks about how you two get along so well and never fight, what’s the secret to your marital success?”\n“Well” said Grandpa Joe after taking a deep puff on his cigar “it all started on the way home from our wedding, we hadn’t gone but a mile when the horse started giving us trouble I gave the horse a little whip and that’s when I heard your Grandma say in a low voice “that’s strike one.” A bit later the horse stopped again “that’s strike two” she said. The third time it stopped she grabbed my shotgun out of my holster and shot it in the head.\nI was in shock!  “What in the world was that all about?” I had protested at the time.  “That’s strike one!”  she said back to me.  ”And that is what I owe our marital success to.”\n \n \n', 4.2, 27, 0, 'http://www.greatcleanjokes.com/3256/marital-bliss-joke/', 0),
(345, 'Master Of The House Joke', 'A solicitor for the Red Cross called upon a well-to-do young couple for a donation. Hearing a commotion inside he knocked extra-loudly on the door.\nA somewhat disheveled man admitted him in. “What can I do for you?” he growled, clearly upset about something.\n“I would like to speak to the master of the house,” said the solicitor politely.\n“Then you’re just in time,” barked the young man. “My wife and I are settling that very question right now!”\n', 4.3, 15, 0, 'http://www.greatcleanjokes.com/3209/master-of-the-house-joke/', 0),
(346, 'Differences between Men and Women', '• Women have more imagination than men. They need it to tell men how wonderful they are.\n• Women have a number of faults. Men have only two – everything they say and everything they do.\n• A successful man is one who makes more money than his wife can spend. A successful woman is one who can find such a man.\n• Men wake up as good-looking as they went to bed. Women somehow deteriorate during the night.\n• When women are depressed they either eat or go shopping. When men are depressed, they invade another country.\n• A man is a person who will pay £2 for a £1 item he wants. A woman, however, will pay £1 for a £2 item that she doesn’t want.\n• Diamonds are a girl’s best friend. Dogs are a man’s best friend. Now you know which sex is smarter.\n• It’s not true that men prefer foolish women. Rather they prefer women who can pretend to be foolish whenever necessary, which is the very core of intelligence.\n• Men always want to be a woman’s first love. Women have a more subtle instinct: What they like is to be a man’s last romance.\n• To be happy with a man, a woman must understand him a lot and love him a little. To be happy with a woman, a man must love her a lot and not try to understand her at all.\n• A woman marries a man expecting he will change, but he doesn’t. A man marries a woman expecting that she won’t change and she does.\n• Men marry because they are tired; women marry because they are curious. Both are disappointed.\n• A woman worries about the future until she gets a husband, while a man never worries about the future until he gets a wife.\n• A woman will always cherish the memory of the man who wanted to marry her; a man will always cherish the memory of the woman who he didn’t.\n• There are two times when a man doesn’t understand a woman – before marriage and after marriage.\n• Only two things are necessary for a man to do to keep his wife happy. One is to let her think she is having her own way, and the other is to let her have it.\n• Married men live longer than single men, but married men are a lot more willing to die.\n• Any married man should forget his mistakes – it’s no use two people remembering the same thing.\n• Some husbands are living proof that a woman can take a joke.\n• Husbands are like cars: all are good the first year.\n• A woman has the last word in any argument. Anything a man says after that is the beginning of a new argument.\n', 4.3, 36, 0, 'http://www.greatcleanjokes.com/3146/differences-between-men-and-women/', 0),
(347, 'Wife Stress Joke', 'Harry had been feeling sick lately and was finally convinced to see the Doctor after his wife Suzy’s urging. After a thorough examination, and much thought, the Doctor was ready to tell Harry and a very worried Suzy, his prognosis. Harry was too stressed out. He would need 6 months of pure relaxation. Suzy, very agitated, took out her notepad to begin writing down his list of orders for these months of relaxation. “How should I go about it?” asked Harry. “OK” said the doctor “I would like your wife to take one tranquilizer four times a day…”\n', 3.6, 23, 0, 'http://www.greatcleanjokes.com/3116/wife-stress-joke/', 0),
(348, 'Jealous Wife Joke', 'Standing in front of a boutique I noticed an impatient looking young man approach an attractive woman “would you mind talking to me for a few minutes?” he asked her “why?” she countered suspiciously.”my wife has been in this shop for a long time” the man explained “But I  know she’ll come out if she see me talking to you”  -E.C.Forbes Jr.\n', 3.8, 128, 0, 'http://www.greatcleanjokes.com/57/marriage-humor-2/', 1),
(349, 'Love Letter Joke', 'Dear Herbie,\nI know it was our joint decision for you to go off to the army for the year, but it’s so hard not having you here. We are married, doesn’t it make sense that we should be together? I’m so miserable without you, it’s almost like you’re still here.\nLove,\nAnne\n', 2.5, 102, 0, 'http://www.greatcleanjokes.com/2443/love-letter-joke/', 1),
(350, 'Funny Love Lines', 'You’re like my asthma – you take my breath away.\nLike dandruff – I can’t get you off my head.\nLike my car – you drive me crazy.\nLike dentures – I can’t smile without you.\n', 3.9, 89, 0, 'http://www.greatcleanjokes.com/1962/funny-love-lines/', 2),
(351, 'Love Joke', 'Why do men like love at first sight?\nIt saves them a lot of time.\n', 3.8, 45, 0, 'http://www.greatcleanjokes.com/1648/love-joke/', 0),
(352, 'Adam and Eve Joke', 'Existence was so tranquil and peaceful for the young couple Adam and Eve, like straight out of a story book, until one unfortunate day when Adam showed up one hour late for supper.\nBy the time Adam finally came home Eve was a nervous wreck, and her imagination was working overtime.\n“Honey, what happened? Why are you home so late?” Questioned Eve. “Oh I’m sorry! Adam responded with a wave of his hand, “I just lost track of the time.”\nNow Eve didn’t have a Mother or girlfriend around to calm her fears, after all it was just her and her Husband and despite Adam’s convincing act  her overactive imagination could not be calmed.\nThat night after two hours of restlessly turning in her bed, enough was enough.\n“WHAT IN THE WORLD ARE YOU DOING!” Hollered Adam jumping out of bed.\n“YOU KNOW DARN WELL WHAT I’M DOING” Screamed Eve right back, “NOW YOU BETTER LAY STILL RIGHT NOW, AND LET ME FINISH COUNTING THOSE RIBS!\n', 4, 22, 0, 'http://www.greatcleanjokes.com/3982/adam-eve-joke/', 0),
(353, 'Father In Law Joke', '“Mom, Dad, sit down.  I have something very important to tell you,” said Samantha, upon her return home from college after graduation. “I met a guy  who lives near the college that I really like and we decided we are going to get married!”\n“Oh Samantha! I am so happy for you!” Gushed her Mom giving her a big hug, “I hope you two will be really happy together! I can’t wait to meet him!”\n“Tell us more about him” said her Dad, “does he have any money?”\n“Oh Dad! Is that all you men ever think about?\nThat was the first question he asked me about you too!”\n \n \n', 3.8, 50, 0, 'http://www.greatcleanjokes.com/3645/father-law-joke/', 0),
(354, 'Divorce Joke', 'Harry and his buddy Sam were going for a stroll. “Sam” said Harry “You know my wife?” “Sure do” said Sam. “Well she ain’t gonna be my wife anymore! Right after the weekend it’s gonna be over! I’m divorcing her!”\nSam was aghast, “Harry, I can’t believe it! You seemed to get along so well together!  And she seemed like such a nice wife too!”\nHarry stopped walking and and turned to Sam. “Sam, take a look at the  loafers I’m wearing. Don’t they look comfy? They have a nice stylish shape, and they look mighty comfortable.  Don’t they Sam?”\n“They do Harry” said Sam, “but I’m not quite sure what you are getting at.” \n“Well guess what Sam?” said Harry raising his voice, “I’m the only one who knows that they are pinching my darn feet!!!”\n', 3.4, 32, 0, 'http://www.greatcleanjokes.com/3496/divorce-joke/', 0),
(355, 'The Happiest Day Joke', 'Harry was finally a  groom and was very excited about his upcoming marriage.  He was on his way out of the office when his boss came over to him with an outstretched hand, “congratulations Harry, I just wanted to tell you I’ve been married for twenty two years, and I am sure that you will always remember this day with the fondest of memories, as the happiest day of your life.” “But sir”, said Harry, “a little bit confused, I’m not getting married until tomorrow!”   “Yeah,  I know”, said his boss.\n', 3.5, 35, 0, 'http://www.greatcleanjokes.com/2921/the-happiest-day-joke/', 0),
(356, 'Joy Of Marriage Joke', 'Marriage is like a bar of soap. It smells delicious until you take a bite out of it!\n', 3.5, 46, 0, 'http://www.greatcleanjokes.com/2721/joy-of-marriage-joke/', 10),
(357, 'Who’s Listening Joke', 'In the first year of marriage, the man speaks and the woman listens.\nIn the second year, the woman speaks and the man listens.\nIn the third year, they both speak and the neighbors listen.\n', 3.4, 57, 0, 'http://www.greatcleanjokes.com/2041/whose-listening-joke/', 0),
(358, 'Marriage Thought', 'Marriage is the chief cause of divorce.\n', 4, 21, 0, 'http://www.greatcleanjokes.com/1467/marriage-thought/', 1),
(359, 'Who’s Wearing The Pants?', 'A man died and went up to heaven. Upon arriving he noticed two signs One said “Men Who Are Bossed By Their wives,” the other one said “Men Not Bossed By Their Wives.” After closer inspection he noticed that while next to the first sign was a big line, by the second sign there was just one man. After getting even closer he realized it was his friend Harry. “Hey Harry” the man questioned “what in the world are you doing here? Your wife bosses you around more then anybody.” “I don’t know” Harry replied “my wife told me to stand here.” \n', 3.8, 71, 0, 'http://www.greatcleanjokes.com/156/marriage-joke-2/', 1),
(360, 'Happiness In Marriage?', ' “I never knew what real happiness was until I got married; and then it was too late.” \n', 4.2, 13, 0, 'http://www.greatcleanjokes.com/110/marriage-joke/', 0),
(361, 'Happy? Married?', 'My wife and I were happy for twenty years. Then we met.\n', 3.1, 22, 0, 'http://www.greatcleanjokes.com/71/marrige-humor-2/', 0),
(362, 'A Marriage Cynic', 'A study was done where it was discovered that married people live longer…………………………….. then they discovered it just feels longer!\n', 3.2, 17, 0, 'http://www.greatcleanjokes.com/62/marriage-humor-3/', 0),
(363, 'Girlfriend Joke', 'My girlfriend makes me want to be a better person…so that I can get a better girlfriend!\n', 2.9, 17, 0, 'http://www.greatcleanjokes.com/3904/girlfriend-joke/', 0),
(364, 'Traveling Joke', 'So it was Jim’s first time leaving Europe, he was excited about visiting America and expanding his horizons. “Excuse me”, said a woman to him at the airport. “Do you happen to be traveling to America?” “As a matter of fact I am” responded Jim. “Do me a favor, my husband left to America 2 months ago and I haven’t seen or heard from him since. If you meet a fellow named John Dun, tell him to call his wife.” Jim happily complied and was on his way. He was barely in America for a hour when he saw a big building with the words Dun Watches, “Wow!” thought Jim “that was easy.” Jim walked into the building and asked the lady behind the desk “do you have a John here?” “Second door on the left,” was her reply. Jim saw a man walking out of the door drying his hands “are you Dun?” he asked. “Yes” came the mystified reply. “Call your wife,” said Jim, “she’s been waiting to hear from you.”\n', 3.1, 36, 0, 'http://www.greatcleanjokes.com/2902/traveling-joke/', 3),
(365, 'Money Joke', 'Like most women, Sandy loves going shopping, much to her husbands chagrin. “Here take a look at this”, says her husband Tom, shoving the credit card statement in front of her. “You spent $250 at Macy’s, $150 at Nordstrom, $122 at Lord and Taylor, and another $225 at JC Penny. How in the world do you expect me to pay for all of this?” “Well,” answers Sandy, taken aback, “I’ve been accused of many things before, but one thing I am certainly not is inquisitive!”    \n', 2, 50, 0, 'http://www.greatcleanjokes.com/2703/money-joke-2/', 0),
(366, 'Vacation Joke', 'Q. Whats it called when one spouse goes on a trip.\nA. Trip for one, vacation for two.\n', 2.8, 25, 0, 'http://www.greatcleanjokes.com/1430/vacation-joke/', 0),
(367, 'Practice Isn’t Always A Good Sign Joke', 'I was very happy when an acquaintance of mine informed me that she was engaged. Trying to help, I told her that before my marriage, I went for premarital counseling and found it very helpful. “Oh, we don’t need counseling,” she quickly assured me, “we were both married several times before!” \n', 2.6, 48, 0, 'http://www.greatcleanjokes.com/2293/practice-isnt-always-a-good-sign-joke/', 0),
(368, 'Honeymoon Joke', 'Honeymoon: The holiday a man takes before he begins to work for\na new boss.\n', 2.9, 33, 0, 'http://www.greatcleanjokes.com/1899/honeymoon-joke/', 1),
(369, 'House Wife Joke', 'A. one –   ONE!  That’s right you guessed it, it’s me! Why ME?! Do you think I have nothing better to do with my time?!  DO YOU THINK A HOUSE GETS CLEANED BY ITSELF???!! Is it my job to change the light bulb too?!\nI feel like I’m constantly running after everyone cleaning up their mess! HAVE YOU SEEN ME SIT DOWN ONCE THE WHOLE DAY?!\nAnd if anyone else in the family ever agrees to put in the light bulb, they complain the whole way through like I am squeezing there neck. It would just be easier for me to just do it myself. Being a housewife is the most under appreciated job in the world!\n \n \n', 3, 42, 0, 'http://www.greatcleanjokes.com/3540/house-wife-joke/', 1),
(370, 'Toupee Joke', 'Ted was going bald there was no two ways about it. Trying to cheer him up his wife Barbara bought him a toupee.\nBarbara was very excited to show off her “new husband”, so she was thrilled when one of their friends invited them to a party at their house.\nIt was later that night after the party that Barbara found Ted lounging around on the couch looking depressed.\n“What’s wrong Honey?” said Barbara sitting down on the couch next to him.\n“I didn’t enjoy the party at all,” complained Ted “I was so self conscious I felt like everyone was able to tell I was wearing a toupee.\n“Oh Sweety” said Barbara patting Ted’s knee, “I’m sure nobody was able to tell!\nIn fact all of the people  at the party that I told, were all surprised!”\n \n', 3.9, 17, 0, 'http://www.greatcleanjokes.com/3419/toupee-joke/', 0),
(371, 'Jury Duty Joke', 'It was Sally’s first time going for jury duty and she was a little bit apprehensive. “I would just like you to know” said Sally as soon as she was in front of the judge “that I feel very strongly that capital punishment is morally unjust and incorrect.” “That’s OK , said the judge “capital punishment is not a possibility in this case so it’s perfectly fine for you to serve on this jury.” “What’s the case about?” Asked Sally. “Well Mrs. Smith is filing a suit against her husband for gambling away the money she had saved for remodeling her bathroom”, replied the judge. “Alright” replied Sally “I’ll serve on this one, I may have been wrong about the capital punishment thing after all.”\n', 3.3, 32, 0, 'http://www.greatcleanjokes.com/2972/jury-duty-joke/', 0),
(372, 'Marriage Truths', 'Marriage is a relationship were one person is always right…………and the other is the husband.           -Arnold\n', 3.9, 43, 0, 'http://www.greatcleanjokes.com/1897/marrige-truths/', 0),
(373, 'Marriage Fight Joke', 'After a quarrel, a wife said to her husband, ‘You know, I was a fool when I married you.’   The Husband replied, ‘Yes, dear, but I was in love and didn’t  notice.’\n', 3.4, 65, 0, 'http://www.greatcleanjokes.com/74/marriage-humor-4/', 0),
(374, 'Legally Blonde Joke', 'Bumper Sticker – CAUTION! – Driver legally blonde! \n', 3.1, 77, 0, 'http://www.greatcleanjokes.com/2222/legally-blonde-joke/', 0),
(375, 'Public Education Joke', 'I SOUPORT PUBLIK EDEKASION. \n', 4.3, 20, 0, 'http://www.greatcleanjokes.com/2073/public-education-joke/', 1),
(376, 'College Student Joke', 'I IS A COLLEGE STUDENT.\n', 3.4, 21, 0, 'http://www.greatcleanjokes.com/2071/college-student-joke/', 0),
(377, 'Quiet Joke', 'HONK, IF YOU LOVE PEACE AND QUIET.\n', 3.5, 22, 0, 'http://www.greatcleanjokes.com/1984/quite-joke/', 0),
(378, 'Deaf Joke', 'HONK ALL YOU WANT – I’M DEAF.\n', 3.6, 12, 0, 'http://www.greatcleanjokes.com/1982/deaf-joke/', 0),
(379, 'Driving Joke', 'IF YOU CAN READ THIS, I CAN SLAM ON MY BRAKES AND SUE YOU.\n', 3.8, 26, 0, 'http://www.greatcleanjokes.com/1979/driving-joke/', 0),
(380, 'Crime Joke', 'FIGHT CRIME – SHOOT BACK. \n', 3, 13, 0, 'http://www.greatcleanjokes.com/1977/crime-joke/', 0),
(381, 'Two Ways To Love Joke', 'I LOVE ANIMALS – THEY TASTE GREAT..\n', 3.3, 37, 0, 'http://www.greatcleanjokes.com/1973/1973/', 1),
(382, 'Cat Lover Joke', 'Bumper Sticker – WE ARE STAYING TOGETHER, FOR THE SAKE OF OUR CATS.\n', 3, 28, 0, 'http://www.greatcleanjokes.com/1971/cat-lover-joke/', 0),
(383, 'Prison Joke', 'Brian hit rock bottom. He was going to jail for insider trading and it couldn’t get much worse than that.\nAs the jail warden brought Brian to his cell, Brian’s worst fears were materialized. Sitting hunched over on a bed was his soon to be roommate. He was a hunk of a man wearing a sleeveless undershirt, with vicious looking tattoos on each arm.\nAs Brian approached the prison cell the giant looked up at him and said in a deep booming voice, “hey man, what did you do to get yourself in here?”\n“White collar crime” responded Brian nervously.\n“Hey man, how about that? Me too,” the giant said.\n“Phew,” said Brian feeling his body relaxing, “To be honest I got a bit nervous when I saw you.”\n“Nah” responded the giant waving his hand “what’s there to be nervous about?”\n“So tell me,” questioned the giant “How many priest’s did you kill?”\n', 3.6, 89, 0, 'http://www.greatcleanjokes.com/3501/prison-joke/', 0),
(384, 'Midget Joke', 'Q. What did the police officer say to the midget complaining that someone picked his pocket?\nA. I can’t believe someone would stoop so low.\n', 3.4, 534, 0, 'http://www.greatcleanjokes.com/2547/midget-joke/', 10),
(385, 'Hurdle Joke', 'I used to be afraid of hurdles but then I got over it.\n', 4.1, 14, 0, 'http://www.greatcleanjokes.com/3322/hurdle-joke/', 0),
(386, 'Soap Joke', 'I used to be addicted to soap. I’m clean now.\n', 4.1, 12, 0, 'http://www.greatcleanjokes.com/3318/soap-joke/', 0),
(387, 'Eyebrows Joke', 'I told my friend that she drew her eyebrows on too high.\nShe looked surprised.\n', 4.2, 26, 0, 'http://www.greatcleanjokes.com/3151/eyebrows-joke/', 0),
(388, 'Cereal Box Joke', 'One morning I saw my husband in the pantry trying to decide between two different types of cereals. “Maybe you should take half a bowl of each”, I said jokingly. “Wow,” he said with a smile, “you really thing out of the box“\n', 1.9, 140, 0, 'http://www.greatcleanjokes.com/627/double-meaning/', 1),
(389, 'Vice President Joke', 'In the year 2000 Joe Lieberman ran for president, being that he was the first potential Jew in high office he was given a lot of attention. After a disappointing loss Joe walked into his house. “Don’t worry” said his wife “in this house you’ll always be vice president!”    \n', 2.6, 147, 0, 'http://www.greatcleanjokes.com/1432/1432/', 0),
(390, 'Birth Control Joke', '“Alright! I’ll drive them to the field trip tomorrow!” Sighed my neighbor resignedly. Sure enough the next day found her with a van full of  7 to 10 year olds.\nClearly distracted, my neighbor  cruised right through a stop sign, “Don’t you know how to stop?” Screamed the exasperated crossing guard, running towards the car.\nMy neighbor stopped her car, looked the crossing guard straight in the eye and said clearly upset, “what makes you think they are all mine?!”\n', 2.5, 71, 0, 'http://www.greatcleanjokes.com/3894/birth-control-joke/', 0),
(391, 'Landlord Joke', '“Sir you have got to help!” said the tearful man at the door. “There is a family that I know very well that is in desperate need of money. The Father has been out of a job for over a year, they have five kids at home with barely a bit of food to eat. The worst part is, that they are about to kicked out of the house and they will be left on the streets without a roof over their heads!” The man concluded with one last heart wrenching sob.  \n“Well,” said the man at the door, “that really is a sad story.  Why don’t you come inside and we’ll talk about it a little more.”\n“So how much money is needed exactly?” asked the man when they were both seated.\n“Oh it’s really terrible”, said the man starting up again, “why just for the rent $3000 is needed by tomorrow otherwise they’ll be kicked out onto the streets.”\n“How do you know so much about this situation?” asked the man as he reached for his check book.\n“Well,” said the man breaking down once more “they are my tenants.”\n', 3, 135, 0, 'http://www.greatcleanjokes.com/3582/landlord-joke/', 1),
(392, 'Peep Joke', 'I couldn’t stop myself from laughing last night as I was putting my 2 year old and 4 year old into bed. “I’M CLOSING THE DOOR NOW AND I DON’T WANT TO HEAR A PEEP!” I hollered. I was about to close the door in a huff when I heard my two year old standing in his crib with a defiant look on his face saying “peep, peep, peep.”\n', 3.1, 69, 0, 'http://www.greatcleanjokes.com/3128/peep-joke/', 0),
(393, 'Bitter Divorce Joke', 'It was a bitter divorce, after four years of marriage and two children it was over. Sam showed up in court together with his ex to see what the verdict would be. Finally after a long court case the verdict was decided. “Ok”, said the judge, turning to Sam, “I am rewarding your ex-wife Ann $470 dollars a month.” “That’s really kind of you, and I really appreciate it” said Sam “I’ll try to send her a little bit from time to time myself.”\n', 3, 69, 0, 'http://www.greatcleanjokes.com/2874/bitter-divorce-joke/', 2),
(394, 'LOL Joke', 'John angrily looked at the text he had just received from his Mom.  It read: “Professor called to say you failed the course.  LOL.  Mom. ”  How could he have failed?! … And all his Mom has to say is that she’s Laughing Out Loud?!  Fed up, he text-ed his Mom: “What was up with the LOL?”  his text said.   “I just wanted to send you Lot’s Of Love because I know how disappointed you must be.”\n', 3.1, 150, 0, 'http://www.greatcleanjokes.com/2789/lol-joke/', 7),
(395, 'Grandmother Joke', 'It was Timmy’s 5th birthday and he was joyfully opening all the presents he received. He saved the biggest for last, so it took a while until he got to opening Grandma’s present. “Wow” Timmy exclaimed in delight, upon seeing the mini drum set that his Grandmother got for him. “Thanks Grandma this is just what I wanted.” It was after Timmy went to bed that Timmy’s mother approached her mother. “Ma, I’m surprised at you, don’t you remember how it used to drive you crazy when we used to play the drums in the house growing up?” Grandma smiled and then said “I remember, of course I remember.” \n', 3.4, 125, 0, 'http://www.greatcleanjokes.com/2723/grandmother-joke/', 2),
(396, 'Hearing Aid Joke', 'While working in a post office, a lady barged in complaining that she got home to find a note from the mail man saying that he tried to deliver a package but nobody was home. “My husband was home all day!”, she fumed. After giving her the package I heard her tell somebody “Oh, I’m so excited, my husbands new hearing aids!”\n', 2.6, 52, 0, 'http://www.greatcleanjokes.com/2675/hearing-aid-joke/', 0),
(397, 'Getting Old Joke', 'Recently divorced, I moved back to my home town hoping to start over again. A few weeks later, while making a dentist appointment, I was surprised to see I recognized the dentist’s name as a good looking boy from my high school 20 years ago. However, upon walking into the dentist’s office, I quickly realized he must be someone else.  He was bald, had a big beer belly, and looked a lot older than me. Just to be sure though, on my way out I asked him if he went to the high school that I had attended. “Yeah”, he responded, “I graduated in 91.” “Oh my gosh”, I excitedly said “you were in my class.” “Really”, he said that’s interesting, “what class did you teach?”\n', 3.8, 65, 0, 'http://www.greatcleanjokes.com/2670/getting-old-joke/', 0),
(398, 'Adoption Joke', 'A woman has twins and gives them up for adoption.\nOne of them goes to a family in Egypt and is named “Ahmal.”\nThe other goes to a family in Spain; they name him “Juan.”\nYears later, Juan sends a picture of himself to his birth mother.\nUpon receiving the picture, she tells her husband that she wishes\nshe also had a picture of Ahmal.  Her husband responds,\nThey’re twins! If you’ve seen Juan, you’ve seen Ahmal.”\n', 2.4, 380, 0, 'http://www.greatcleanjokes.com/2648/adoption-joke/', 11),
(399, 'Porshe Joke', 'Anxious to finally get the porch painted, I urged by husband to allow the man that knocked on our door looking for handiwork to do the job. The man happily agreed to paint it for $50. We were thrilled at our good luck of getting our wide porch painted for a measly $50. Minutes later there was a knock at the door. “All done” he said. “Already?” we both said at once. “Yeah, and by the way, it’s a lexus not a porsche”.\n', 3.7, 29, 0, 'http://www.greatcleanjokes.com/2305/porshe-joke/', 0),
(400, 'Immigrant Joke', 'An immigrant from Poland who was married to an American barged into the police station out of breath. “My wife, she try to kill me” he stammered. “Are you absolutely sure?” questioned the police officer. “Of course I sure” he countered insulted “you think I dumb, look what I found in her purse” he said pulling a bottle out of his pocket, “look it says polish remover!”  \n', 3.2, 69, 0, 'http://www.greatcleanjokes.com/1450/1450/', 1),
(401, 'Dirty Restaurant Joke', 'A couple walked into a cheap looking restaurant. As they were about to sit down they noticed there were crumbs on the seat, after cleaning up the seat and wiping down the table they sat down. A waitress came over asking them what they wanted, “I’ll just take a coffee” said the man, “me too” said the lady “and make sure the cup is clean.” The waitress returned with their drinks “OK” she said placing down their cups “now, which one of you wanted the clean cup”. \n', 3.3, 50, 0, 'http://www.greatcleanjokes.com/1134/clean-freaks/', 0),
(402, 'How To Get Rid Of Junk', 'My husband was trying to get rid of a perfectly good couch, but despite it being outside for over a week with a sign that said “FREE” nobody was taking it. Then my teenage son thought of a plan, he put a sign “$50″ on it, it was gone the next day!    \n', 3.6, 14, 0, 'http://www.greatcleanjokes.com/822/how-to-get-rid-of-junk/', 0),
(403, 'Funny Names', 'My husband’s name is Bud and my name is Beth. For our 20th anniversary my son got us a name plate for our house it said “Bud Beth and Beyond”\n', 3.5, 25, 0, 'http://www.greatcleanjokes.com/622/funny-names/', 0),
(404, 'Manly Men Joke', 'My husband was trying to be nonchalant before a speech he was about to give. “Are you nervous” I asked “Nah” he said with a yawn “piece of tea, piece of tea.”\n', 2.5, 27, 0, 'http://www.greatcleanjokes.com/473/manly-men-men-jokes/', 0),
(405, 'Outhouse Joke', 'A man gathered all of his children together and said “Children when George Washington knocked down the cherry tree, he told his father honestly that it was him , now answer me honestly, Who knocked down the outhouse? Finally the youngest son admitted it was him, at which he received a lashing he wouldn’t soon forget. “Thats not fair” complained the son, “George Washington didn’t get punished when he told the truth.”\n“Son” replied the Father “The difference is, that George Washington’s  father wasn’t in the tree when he knocked it down!”\n', 4.2, 34, 0, 'http://www.greatcleanjokes.com/201/outhouse-humor/', 0),
(406, 'Amish Joke', 'An Amish girl and her mother were visiting a mall. They were amazed by almost everything they saw, but especially by two shiny, silver walls that could move apart and back together again. The girl asked, “Mother, what is this?”\nThe mother, never having seen an elevator, responded, “I have never seen anything like this in my life. I don’t know what it is.”\nWhile the girl and her mother watched with amazement, an old man in a wheelchair rolled up to the moving walls and pressed a button.\nThe walls opened and the man rolled between them into a small room. The walls closed and the girl and her mother watched the small numbers above the walls light up sequentially. They continued to watch until the last number was reached, and they watched some more as the numbers began to light in reverse order.\nThe walls opened up again and a hunky young man stepped out.\nThe mother, not taking her eyes off the young man, said quietly to her daughter, “Go get your father.”\n﻿\n', 4.1, 57, 0, 'http://www.greatcleanjokes.com/287/amish-joke/', 1),
(407, 'The Blind Man Joke', 'A blind man  walks into a store with a seeing eye dog. Much to the store owners surprise the blind man picks up the dog by it’s tail and starts swinging it around over his head. Puzzled, and a bit upset the store owner walks over to the man and says, “excuse me sir can I help you.”  “No thank you” the blind man replies “I’m just looking around!”\n', 3.8, 52, 0, 'http://www.greatcleanjokes.com/171/funny-story-6/', 1),
(408, 'The Tricky Wife Joke', 'A lady was walking down the street when she was a approached by a lady beggar asking for money. The lady took a $20 bill out of her purse, and asked “if I give you this money will you spend it on chocolate.” “Don’t be ridiculous” the beggar replied “does it look like I have nothing better to spend money on?” “How about shopping?” she asked. “No,” the beggar said, “don’t you understand I need money just to stay alive.” “Will you spend it on your hair?” the lady asked. Annoyed the beggar replied, “No, I just need money for food, and shelter. “In that case” the lady said “I don’t want to just give you money I would like you to eat out with me and my husband tonight.”\n“Why?” The beggar asked. “Well,”the lady said “I think it’s important for him to see what a lady looks like after she gives up chocolate, shopping, and hair appointments.”\n', 4.1, 205, 0, 'http://www.greatcleanjokes.com/164/funny-story-5/', 5),
(409, 'Get A Raise Joke', 'One day an employee sends a letter  to his boss to increase his salary!!!\nIn thi$ life, we all need $ome thing mo$t de$perately.  I think you  $hould be under$tanding of the need$ of u$ worker$ who have given $o much $upport including $weat and $ervice to your company.\nI am $ure you will gue$$ what I mean and re$pond $oon\nYour$ $incerely,\nNorman $oh\nThe next day, the employee received this letter of reply:\nI kNOw  you have been working very hard. NOwadays, NOthing  much has changed. You must have NOticed  that our company is NOt  doing NOticeably  well .\nNOw  the newspaper are saying the world`s leading ecoNOmists  are NOt  sure if the United States may go into aNOther  recession. After the NOvember  presidential elections things may turn bad.\nI have NOthing  more to add NOw You kNOw  what I mean.\nYours truly,\nManager\n', 4.2, 224, 0, 'http://www.greatcleanjokes.com/80/funny-story-3/', 4),
(410, 'One Letter Makes A Big Difference', 'An Illinois man  left the snow-filled streets of Chicago for a vacation in Florida. His wife was on a business trip and was planning to meet him there the next day. When he reached his hotel he decided to send his wife a quick email. Unfortunately, when typing her address, he missed one letter, and his note was directed instead to an elderly preacher’s wife whose husband had passed away only the day before. When the grieving widow checked her email, she took one look at the monitor, let out a piercing scream, and fell to the floor in a dead faint.At the sound, her family rushed into the room and saw this note on the screen: Dearest Wife,\nJust got checked in. Everything prepared for your arrival tomorrow. P.S. Sure is hot down here.\n', 4.2, 724, 0, 'http://www.greatcleanjokes.com/78/funny-story-2/', 14),
(411, 'Lisp Joke', 'Ever Wonder? Whose cruel idea was it for the word “Lisp” to have a “S” in it? \n', 3.9, 28, 0, 'http://www.greatcleanjokes.com/1999/lisp-joke/', 0),
(412, 'Civil War Joke', 'Ever Wonder? How is it possible to have a civil war? \n', 2.8, 14, 0, 'http://www.greatcleanjokes.com/1992/civil-war-joke/', 0),
(413, 'Pencil Thought', 'Ever Wonder? If the #2 pencil is the most popular, why is it still #2? \n', 4, 30, 0, 'http://www.greatcleanjokes.com/1990/pencil-thought/', 0),
(414, 'Gardener Joke', 'Ever Wonder? What do gardeners do after they retire?\n', 2.7, 24, 0, 'http://www.greatcleanjokes.com/1752/gardener-joke/', 0),
(415, 'Lemon Thought', 'Ever Wonder? Why is lemon juice made with artificial flavor, and dishwashing soap made with real lemons?\n', 3.9, 27, 0, 'http://www.greatcleanjokes.com/1641/lemon-thought/', 0),
(416, 'Abbriviated Thought', 'Ever Wonder? Why is “abbreviated” such a long word?\n', 3.5, 10, 0, 'http://www.greatcleanjokes.com/1638/abbriviated-thought/', 0),
