(419, 'Ball Game Thoughts', 'Ever Wonder? Why do we sing ‘Take me out to the ball game’, when we are already there?\n', 2.8, 8, 0, 'http://www.greatcleanjokes.com/1479/ball-game-thoughts/', 0),
