(422, 'Cheese Thought', 'The early bird may get the worm, but the second mouse gets the cheese.\n', 4.1, 23, 0, 'http://www.greatcleanjokes.com/1459/cheese-thought/', 0),
(423, 'Pizza Musings', 'Ever Wonder? Why does round pizza come in a square box?\n', 2.6, 15, 0, 'http://www.greatcleanjokes.com/1426/pizza-musings/', 0),
(424, 'Thoughts About Money', 'Ever wonder? If you have to put two cents in, but it’s only a penny for your thoughts, who gets the extra penny?\n', 2.8, 10, 0, 'http://www.greatcleanjokes.com/1424/thoughts-about-thoughts/', 0),
